INSERT INTO `mwtext` (`old_id`, `old_text`, `old_flags`) VALUES
(1,	'\'\'\'已成功安装MediaWiki。\'\'\'\n\n请查阅[//meta.wikimedia.org/wiki/Help:Contents 用户指南]以获取使用本wiki软件的信息！\n\n== 入门 ==\n* [//www.mediawiki.org/wiki/Special:MyLanguage/Manual:Configuration_settings MediaWiki配置设置列表]\n* [//www.mediawiki.org/wiki/Special:MyLanguage/Manual:FAQ/zh-hans MediaWiki常见问题]\n* [https://lists.wikimedia.org/mailman/listinfo/mediawiki-announce MediaWiki发布邮件列表]\n* [//www.mediawiki.org/wiki/Special:MyLanguage/Localisation#Translation_resources 本地化MediaWiki到您的语言]',	'utf-8'),
(2,	'\'\'\'本站的目标是建立一个能够解决人类问题的百科和交流平台\'\'\'\n\n\n== [[:Category:计算机]] ==\n\n\n== 入门 ==\n* [//www.mediawiki.org/wiki/Special:MyLanguage/Manual:Configuration_settings MediaWiki配置设置列表]\n* [//www.mediawiki.org/wiki/Special:MyLanguage/Manual:FAQ/zh-hans MediaWiki常见问题]\n* [https://lists.wikimedia.org/mailman/listinfo/mediawiki-announce MediaWiki发布邮件列表]\n* [//www.mediawiki.org/wiki/Special:MyLanguage/Localisation#Translation_resources 本地化MediaWiki到您的语言]',	'utf-8'),
(3,	'[[编程语言]]\n[[网络代理]]',	'utf-8'),
(4,	'\n[[计算机/编程语言]]\n[[计算机/网络代理]]',	'utf-8'),
(5,	'== Wikipedia ==\n[[https://zh.wikipedia.org/wiki/%E4%BB%A3%E7%90%86%E6%9C%8D%E5%8A%A1%E5%99%A8 代理服务器]]\n\n== 代理协议 ==\n\n;FTP代理服务器\n:主要用于访问[[FTP]]服务器，一般有上传、下载以及缓存功能。端口一般为21、2121等。\n\n;HTTP代理服务器\n:主要用于访问网页，一般有内容过滤和缓存功能。端口一般为80、8080、3128等。\n\n;SSL/TLS代理\n:主要用于访问[[https|加密网站]]，一般有[[SSL]]或[[TLS]]加密功能（最高支持128位加密强度）。端口一般为443。\n\n;RTSP代理\n:主要用于[[Realplayer]]访问Real[[流媒体]]服务器，一般有缓存功能。端口一般为554。\n\n;Telnet代理\n:主要用于[[telnet]]远程控制（黑客入侵计算机时常用于隐藏身份）。端口一般为23。\n\n;POP3/SMTP代理\n:主要用于POP3/SMTP方式收发邮件，一般有缓存功能。端口一般为110/25。\n\n;SOCKS代理\n:只是单纯传递数据包，不关心具体协议和用法，所以速度快很多。一般有缓存功能。端口一般为1080。（SOCKS代理协议又分为[[SOCKS|SOCKS4]]和[[SOCKS|SOCKS5]]，SOCKS4协议只支持[[TCP]]，而SOCKS5协议支持[[TCP]]和[[UDP]]，还支持各种身份验证机制、服务器端域名解析等。简单来说：SOCK4能做到的SOCKS5都可以做到，但SOCKS5能做到的SOCK4不一定能做到）\n\n;Shadowsocks代理\n:A fast tunnel proxy that helps you bypass firewalls. https://github.com/shadowsocks/shadowsocks',	'utf-8'),
