(15,	'== 新农村建设房 ==\n\n主要是要解决好“三农”问题，努力改善农村生产生活条件，提高农民生活质量，大力发展农村教育、科技、卫生、文化等社会事业，促进农村和谐稳定，促使农村整体面貌出现较大改观，努力增加农民收入，同时改善农民的居住环境，建设更加舒适的住宅形式。但农民建设在宅基地上的房屋，是不可以卖给村集体以外的成员的。因此，这样的房也是无法过户的! 属于集体所有制的农村土地在集体内部可以买卖，比如，同村村民可以相互交易，但是不能集体所有制的土地不能卖给集体外面的人，如果要上市交易，必须先经过政府征地，将土地使用权转化成国有，然后才可以通过土地市场出让。\n\n[[Category: 北京市/房地产]]',	'utf-8'),
(16,	'== 小产权房  ==\n\n村集体组织或者开发商打着新农村建设等名义出售的、建筑在集体土地上的房屋或是由农民自行组织建造的“商品房”。\n\n[[Category: 北京市/房地产]]',	'utf-8'),
