(82,	'== 中国房价 ==\n\n商品价格一直是根据供需关系动态调整的。从[[中国人口统计]]中不难看出，计划生育导致1990~2000年新生人口数量降低，到了2025年中国人口预计到达顶峰（之后因老龄人口比例较大，每年自然死亡人口会大于新生）；假设购房需求产生于25～35岁之间，那么房产的购买需求量也会在 2020～2030年逐年降低。加上目前房产库存量大，10年后买房，房价肯定低于现在的价格加上通货膨胀。\n\n当然这不代表北京的房价10年后会降多少，北京地贵，很难预测城市人口到一个什么数量才算饱和。可能出现的结果是乡镇人口持续减少，城市照样拥挤。但是这十年，房价不会猛增。对于80后的个人而言，如果现在没有买房，但是在北京长期工作，可以考虑长租，一次性签五年或者十年。算下来两个人十年房租，假设一个月5000，60万，也低于同样条件房子的首付款了，还不用还房贷。十年后干得好可以全款买，干得不好回二线城市，全款也够。\n\n有点自我安慰的意思。但是房子肯定没我们现在想得那么值钱。东五环内高碑店没房产证的[[北京市/房地产/新农村建设房|新农村建设房]]，45平 LOFT 全款60万，东五环内沿着朝阳北路有大片的荒地，房价都是政府抬起来的。写这些的意思是说，不要绝望，沉下心做自己该做的事情，发挥自己的价值，一切都会好起来的。',	'utf-8'),
(83,	'== 中国房价 ==\n\n商品价格一直是根据供需关系动态调整的。从[[中国人口统计]]中不难看出，计划生育导致1990~2000年新生人口数量降低，到了2025年中国人口预计到达顶峰（之后因老龄人口比例较大，每年自然死亡人口会大于新生）；假设购房需求产生于25～35岁之间，那么房产的购买需求量也会在 2020～2030年逐年降低。加上目前房产库存量大，10年后买房，房价肯定低于现在的价格加上通货膨胀。\n\n当然这不代表北京的房价10年后会降多少，北京地贵，很难预测城市人口到一个什么数量才算饱和。可能出现的结果是乡镇人口持续减少，城市照样拥挤。但是这十年，房价不会猛增。对于80后，90后个人而言，如果现在没有买房，但是在北京长期工作，可以考虑长租，一次性签五年或者十年。算下来两个人十年房租，假设一个月5000，60万，也低于同样条件房子的首付款了，还不用还房贷。十年后干得好可以全款买，干得不好回二线城市，全款也够。\n\n有点自我安慰的意思。但是房子肯定没我们现在想得那么值钱。东五环内高碑店没房产证的[[北京市/房地产/新农村建设房|新农村建设房]]，45平 LOFT 全款60万，东五环内沿着朝阳北路有大片的荒地，房价都是政府抬起来的。写这些的意思是说，不要绝望，沉下心做自己该做的事情，发挥自己的价值，一切都会好起来的。',	'utf-8'),
