(95,	'== 官方网站 ==\n[https://www.mediawiki.org/ MediaWiki]\n\n== 使用 ==\n\n=== 集成多说评论 ===\n多说本身有做 MediaWiki 的官方集成支持。安装步骤写在[https://github.com/duoshuo/duoshuo-mediawiki Github]上。\n\n其中，主要是 <code>$wgDuoshuoShortName = \'你的多说域名\';</code> 这个配置项目比较莫名其妙，比如后台显示应用域名为 roomchat.duoshuo.com，这里需要写成 <code>$wgDuoshuoShortName = \'roomchat\';</code>',	'utf-8'),
(96,	'== 官方网站 ==\n[https://www.mediawiki.org/ MediaWiki]\n\n== 使用 ==\n\n=== 集成多说评论 ===\n多说本身有做 MediaWiki 的官方集成支持。安装步骤写在[https://github.com/duoshuo/duoshuo-mediawiki Github]上。\n\n其中，主要是 <code>$wgDuoshuoShortName = \'你的多说域名\';</code> 这个配置项目比较莫名其妙，比如后台显示应用域名为 <code>roomchat.duoshuo.com</code>，这里需要写成 <code>$wgDuoshuoShortName = \'roomchat\';</code>',	'utf-8'),
(97,	'== 官方网站 ==\n[https://www.mediawiki.org/ MediaWiki]\n\n== 使用 ==\n\n=== 集成多说评论 ===\n多说本身有做 MediaWiki 的官方集成支持。安装步骤写在[https://github.com/duoshuo/duoshuo-mediawiki Github]上。\n\n其中，主要是 <code>$wgDuoshuoShortName = \'你的多说域名\';</code> 这个配置项目比较莫名其妙，比如后台显示应用域名为 <code>roomchat.duoshuo.com</code>，这里需要写成 <code>$wgDuoshuoShortName = \'roomchat\';</code>\n\n[[Category:开源软件]]',	'utf-8'),
