(107,	'\'\'\'Hi 你可以在这里整理、分享知识，添加你认为有用的内容 ：）\'\'\'\n\n== 原则 ==\n说几个词条编辑原则：\n\n* 词条的 title 为树形结构，有子分类的 title ，需要加前缀 “ Category:”，比如 [[:Category:计算机/编程语言]]\n* 非原创的内容，尽量放链接，但是需要添加链接内容描述。词条内容不仅仅包括定义，可以涵盖不同属性，参考 [[:Category:软件开发/iOS]] 。\n* 跟自己的工作或者生活相关，能对他人有帮助的信息，信息越直观越好，有图片、视频的优先展示\n* 地域性差异比较大的内容，建议在城市大类里面分散编辑，比如吃喝玩乐\n* 公共分类，尽量保持客观中立。如果想表达个人观点，把 title 格式设置为 User:$yourname/$title，例如 [[User:Root/北京房价]]\n\n== 技术 ==\n[[File:TechEditorWechatGroup.jpg|200px|thumb|right|技术类编辑微信群]]\n\n* [[:Category:计算机]]\n* [[:Category:软件开发]]\n* [[:Category:开源软件]]\n\n有兴趣编辑技术类词条的朋友，可以加微信群：\n\n== 生活 ==\n* [[:Category:北京市]]\n* [[:Category:杭州市]]\n* [[:Category:玩具]]\n\n== 参考信息 ==\n* [[中国人口统计]]\n\n== 艺术 ==\n* [[音乐制作软件]]\n\n== 入门 ==\n* [//zh.wikipedia.org/wiki/Help:编辑页面 MediaWiki编辑语法]\n\n== RoomChat ==\nRoomChat产品、功能设计：[[RoomChat]]',	'utf-8'),
(108,	'== 官方网站 ==\n[https://www.mediawiki.org/ MediaWiki]\n\n== 使用 ==\n\n=== 集成多说评论 ===\n多说本身有做 MediaWiki 的官方集成支持。安装步骤写在[https://github.com/duoshuo/duoshuo-mediawiki Github]上。\n\n其中，主要是 <code>$wgDuoshuoShortName = \'你的多说域名\';</code> 这个配置项目比较莫名其妙，比如后台显示应用域名为 <code>roomchat.duoshuo.com</code>，这里需要写成 <code>$wgDuoshuoShortName = \'roomchat\';</code>\n\n== 容许展示站外图片 ==\n[https://www.mediawiki.org/wiki/Manual:$wgAllowExternalImages Manual:$wgAllowExternalImages]\n\n[[Category:开源软件]]',	'utf-8'),
