(119,	'Android Lint 可以检测出项目中无用的资源。但是要自动删除，需要额外的工具 [https://github.com/KeepSafe/android-resource-remover android-resource-remover]。目前测试发现，Android Studio 项目，android-resource-remover 可以删除无用的 xml 文件和图片，但是无法处理 string.xml，dimens.xml 之类。\n\n参考 [http://stackoverflow.com/questions/6373482/remove-all-unused-resources-from-an-android-project Remove all unused resources from an android project]',	'utf-8'),
(120,	'Android Lint 可以检测出项目中无用的资源。但是要自动删除，需要额外的工具 [https://github.com/KeepSafe/android-resource-remover android-resource-remover]。目前测试发现，Android Studio 项目，android-resource-remover 可以删除无用的 xml 文件和图片，但是无法处理values 目录下的 string.xml，dimens.xml 之类。\n\n参考 [http://stackoverflow.com/questions/6373482/remove-all-unused-resources-from-an-android-project Remove all unused resources from an android project]',	'utf-8'),
