(128,	'大家可以先参考Stackoverflow 问题：[http://stackoverflow.com/questions/2900023/change-language-programatically-in-android Change language programatically in Android]\n\n其实有个更简单的办法：把目标语言包的 strings.xml 文件覆盖设备对应的语言包文件夹。国产手机可能很多语言无法切换到，可以用这种方式做测试。',	'utf-8'),
(129,	'大家可以先参考 Stackoverflow 的代码解决方案：[http://stackoverflow.com/questions/2900023/change-language-programatically-in-android Change language programatically in Android]\n\n其实有个更简单的办法：把目标语言包的 strings.xml 文件覆盖设备对应的语言包文件夹。国产手机可能很多语言无法切换到，可以用这种方式做测试。\n\n[[Category:软件开发/Android]]',	'utf-8'),
(130,	'\n== 项目重构 ==\n[[:Category:软件开发/Android/删除项目中无用的资源|删除项目中无用的资源]]\n\n== Q&A ==\n* [[:Category:软件开发/Android/更改应用默认语言|更改应用默认语言]]\n* [http://www.nextcomputers.org/NeXTfiles/Software/WebObjects/Guides/PortingObjectiveCtoJava.pdf Porting Objective-C to Java]\n* [http://www.wikihow.com/Edit-the-Contents-of-a-.Jar-File-on-a-Mac How to Edit the Contents of a .Jar File on a Mac]\n\n[[Category:软件开发]]',	'utf-8'),
(131,	'Android Lint 可以检测出项目中无用的资源。但是要自动删除，需要额外的工具 [https://github.com/liruqi/android-resource-remover liruqi/android-resource-remover]。目前测试发现，Android Studio 项目，android-resource-remover 可以删除无用的 xml 文件和图片，但是无法处理values 目录下的 string.xml，dimens.xml 之类。\n\n其中，[https://github.com/KeepSafe/android-resource-remover KeepSafe/android-resource-remover] 无法清理 values 目录中的 xml 资源。在 [https://github.com/liruqi/android-resource-remover liruqi/android-resource-remover] 有修复。\n\n参考 [http://stackoverflow.com/questions/6373482/remove-all-unused-resources-from-an-android-project Remove all unused resources from an android project]',	'utf-8'),
(132,	'Android Lint 可以检测出项目中无用的资源。但是要自动删除，需要额外的工具 [https://github.com/liruqi/android-resource-remover liruqi/android-resource-remover]。目前测试发现，Android Studio 项目，[https://github.com/KeepSafe/android-resource-remover KeepSafe/android-resource-remover] 可以删除无用的 xml 文件和图片，但是无法处理values 目录下的 string.xml，dimens.xml 之类，在 [https://github.com/liruqi/android-resource-remover liruqi/android-resource-remover] 有修复。\n\n参考 [http://stackoverflow.com/questions/6373482/remove-all-unused-resources-from-an-android-project Remove all unused resources from an android project]',	'utf-8'),
(133,	'Android Lint 可以检测出项目中无用的资源。但是要自动删除，需要额外的工具 [https://github.com/liruqi/android-resource-remover liruqi/android-resource-remover]。目前测试发现，Android Studio 项目，[https://github.com/KeepSafe/android-resource-remover KeepSafe/android-resource-remover] 可以删除无用的 xml 文件和图片，但是无法处理values 目录下的 string.xml，dimens.xml 之类，在 [https://github.com/liruqi/android-resource-remover liruqi/android-resource-remover] 有修复。\n\n参考 [http://stackoverflow.com/questions/6373482/remove-all-unused-resources-from-an-android-project Remove all unused resources from an android project]\n\n[[Category:软件开发/Android]]',	'utf-8'),
(134,	'Xtercher 协议文档\n\n登录接口：http://xtecher.com/Wap/UserAccount/loginPage\n\n* HomePage（即第一个tab）对应页面url http://xtecher.com/Wap/ProjectList/index\n* Discover(第二个tab）对应的页面url http://xtecher.com/Wap/Discover/index\n* My profile（第四个tab）对应的页面url http://xtecher.com/Wap/Profile/my\n\n= friendsList接口  =\n接口：\nhttp://xtecher.com/Wap/Client/getFriendsList?token=xxxxxx\n\n返回数据示例：\nstatus = 1代表正常状态\ndata中包含一个数组，数组中是好友信息，其中avator是头像链接，name是用户名，job_title和company_name共同组成好友列表页名字下方的description信息，具体你可以参照一下UI图。有不明之处随时问我，辛苦了，thanks。\n{\"data\":[{\"uid\":\"8\",\"name\":\"Ping\",\"job_title\":\"Product Designer\",\"company_name\":\"Xtecher\",\"avator\":\"http:\\/\\/xtecher.com\\/Uploads\\/Avator\\/552ce21d9a697.jpg\"}],\"status\":1}\n\ntoken可使用之前的登录接口通过登录操作来生成。\n\n接口调用示例：\n\nhttp://xtecher.com/Wap/UserAccount/checkToken?token={token}\n\n正确返回示例：\n{\"data\":{\"uid\":\"1\",\"name\":\"ZhangKai\",\"pinyin\":\"ZhangKai\",\"pinyin_index\":\"Z\",\"sex\":\"0\",\"email\":\"\",\"job_title\":\"CTO\",\"company_name\":\"Baidu\",\"head_img\":\"553683d0b26c1.jpg\",\"id_authorization\":\"0\",\"location_id\":\"0\",\"linked_in\":\"\",\"wechat\":\"aaa\",\"weibo\":\"\",\"tinyurl\":\"\",\"location\":null,\"huanxinpwd\":\"123456\"},\"status\":1}\n其中 uid等于环信用户名，huanxinpwd为环信密码\n\n无效token返回示例：\n\n{\"data\":\"invalid token\",\"status\":0}',	'utf-8'),
(135,	'Xtercher 协议文档\n\n登录接口：http://xtecher.com/Wap/UserAccount/loginPage\n\n* HomePage（即第一个tab）对应页面url http://xtecher.com/Wap/ProjectList/index\n* Discover(第二个tab）对应的页面url http://xtecher.com/Wap/Discover/index\n* My profile（第四个tab）对应的页面url http://xtecher.com/Wap/Profile/my\n\n\n== FriendsList  ==\n\n接口：\nhttp://xtecher.com/Wap/Client/getFriendsList?token=xxxxxx\n\n返回数据示例：\nstatus = 1代表正常状态\ndata中包含一个数组，数组中是好友信息，其中avator是头像链接，name是用户名，job_title和company_name共同组成好友列表页名字下方的description信息，具体你可以参照一下UI图。有不明之处随时问我，辛苦了，thanks。\n{\"data\":[{\"uid\":\"8\",\"name\":\"Ping\",\"job_title\":\"Product Designer\",\"company_name\":\"Xtecher\",\"avator\":\"http:\\/\\/xtecher.com\\/Uploads\\/Avator\\/552ce21d9a697.jpg\"}],\"status\":1}\n\n== Check Token ==\n\ntoken可使用之前的登录接口通过登录操作来生成。\n\n接口：\n\nhttp://xtecher.com/Wap/UserAccount/checkToken?token={token}\n\n正确返回示例：\n{\"data\":{\"uid\":\"1\",\"name\":\"ZhangKai\",\"pinyin\":\"ZhangKai\",\"pinyin_index\":\"Z\",\"sex\":\"0\",\"email\":\"\",\"job_title\":\"CTO\",\"company_name\":\"Baidu\",\"head_img\":\"553683d0b26c1.jpg\",\"id_authorization\":\"0\",\"location_id\":\"0\",\"linked_in\":\"\",\"wechat\":\"aaa\",\"weibo\":\"\",\"tinyurl\":\"\",\"location\":null,\"huanxinpwd\":\"123456\"},\"status\":1}\n其中 uid等于环信用户名，huanxinpwd为环信密码\n\n无效token返回示例：\n\n{\"data\":\"invalid token\",\"status\":0}',	'utf-8'),
