(149,	'== iOS Dev Center ==\nhttps://developer.apple.com/devcenter/ios/index.action\n\n== 教程 ==\n* http://objc.io/\n* http://www.raywenderlich.com/\n\n== SDK ==\n\n=== iOS7 ===\niOS 对状态栏 (Status Bar)、导航栏(Navigation Bar) 做了很大的改造，设计美感提升很多，给开发者带来的问题也很多。\n\n* iOS7 下修改状态栏颜色 [http://stackoverflow.com/questions/17678881/how-to-change-status-bar-text-color-in-ios-7 How to change Status Bar text color in iOS 7]\n* <code>- preferredStatusBarStyle</code> 无法修改状态栏颜色，其中存在 UINavigationController 的时候需要单独处理 [http://stackoverflow.com/questions/19022210/preferredstatusbarstyle-isnt-called preferredStatusBarStyle isn\'t called]\n* 导航栏颜色失真、泛白 [http://stackoverflow.com/questions/18177010/how-to-change-navigation-bar-color-in-ios-7-or-6 Get the right color in iOS7 translucent navigation bar]\n\n=== UITabBarController ===\n\n<code>UITabBarController</code> 自带了 <code>UITabBar</code> 视图。使用的时候，不应该直接管理 <code>UITabBar</code> 的 items。而应该用 <code>UITabBarController</code> 提供的  <code>-  (void)setViewControllers</code> 系列方法。\n\n== 活跃的开发者 ==\n* [http://www.devtang.com/ 唐巧]\n\n[[Category:软件开发]]',	'utf-8'),
(150,	'\'\'\'Hi 你可以在这里整理、分享知识，添加你认为有用的内容 ：）\'\'\'\n\n== 原则 ==\n说几个词条编辑原则：\n\n* 词条的 title 为树形结构，有子分类的 title ，需要加前缀 “ Category:”，比如 [[:Category:计算机/编程语言]]\n* 非原创的内容，尽量放链接，但是需要添加链接内容描述。词条内容不仅仅包括定义，可以涵盖不同属性，参考 [[:Category:软件开发/iOS]] 。\n* 跟自己的工作或者生活相关，能对他人有帮助的信息，信息越直观越好，有图片、视频的优先展示\n* 地域性差异比较大的内容，建议在城市大类里面分散编辑，比如吃喝玩乐\n* 公共分类，尽量保持客观中立。如果想表达个人观点，把 title 格式设置为 User:$yourname/$title，例如 [[User:Root/北京房价]]\n\n== 技术 ==\n[[File:TechEditorWechatGroup.jpg|200px|thumb|right|技术类编辑微信群]]\n\n* [[:Category:计算机]]\n* [[:Category:软件开发]]\n* [[:Category:开源软件]]\n* [[:Category:操作系统]]\n\n有兴趣编辑技术类词条的朋友，可以加微信群：\n\n== 生活 ==\n* [[:Category:北京市]]\n* [[:Category:杭州市]]\n* [[:Category:玩具]]\n* [[:Category:电子游戏]]\n* [[:Category:400电话/诈骗]]\n\n== 参考信息 ==\n* [[中国人口统计]]\n\n== 艺术 ==\n* [[音乐制作软件]]\n\n== 入门 ==\n* [//zh.wikipedia.org/wiki/Help:编辑页面 MediaWiki编辑语法]\n\n== RoomChat ==\nRoomChat产品、功能设计：[[RoomChat]]',	'utf-8'),
(151,	'400电话申请门槛不高，另外也有改号软件可以拨出400电话。很多骗子利用这个诈骗。',	'utf-8'),
(152,	'400-163-8888 冒充客服套银行卡信息。\n\n事后找客服的聊天纪录。\n\n<pre>\n小翠	2015-05-20 12:04:51\n\n我	2015-05-20 12:05:10\n您好刚收到一个优购号码打来的电话\n我	2015-05-20 12:05:40\n说是我的账号被优购员工误操作加入到了什么企业用户里边了， 然后问我要不要取消\n我	2015-05-20 12:05:48\n然后就开始要我的银行名称。\n我	2015-05-20 12:06:04\n我想确认一下是不是有这种事？\n小翠	2015-05-20 12:06:38\n凡是“400”、“800”开头的号码以及“110”等特殊号码，是运营商为大型企业或一些特殊机关、行业开设的特殊热线电话，此类电话仅具有接入功能，均无外呼功能。\n小翠	2015-05-20 12:06:50\n您好，我司是有直销平台，但是不会收取任何合作费用，另外客服也不会主动让您提供银行信息，小心是诈骗份子哦，我司直销平台：zhixiao.yougou.com\n小翠	2015-05-20 12:07:14\n我们公司外呼电话是0755开头的呢，所以您接到的是诈骗的呢\n小翠	2015-05-20 12:07:26\n最近接到诈骗电话，我们技术排查出了这样一种原因：  可能用户安装了一些不安全的插件，导致自己的信息被获取到了  除了用户被装插件，还有一个重要来源是，其他网站的用户名和密码泄露后，骗子用这些用户名和密码在各电商网站试登陆。登陆成功后就获取到用户的相关订单了。  因为很多人上不同网站，用户名和密码有不少是用得一样的。  建议顾客提高自我防范意识外，也要定期清理电脑换货与安全控件；使用手机上网时，不要使用没有密码的公共WIFI，类似情况在315晚会上有报道过。\n我	2015-05-20 12:07:30\n那个骗子连我在优购买了什么样子的鞋子都知道\n我	2015-05-20 12:07:39\n是不是你们的数据库泄露了？\n我	2015-05-20 12:07:43\n还知道我的名字\n小翠	2015-05-20 12:08:03\n诈骗份子可以黑到网站偷取内部资料的呢，您不要相信就可以了的\n小翠	2015-05-20 12:08:25\n目前较多诈骗不法份子通过某种手段获取到您的信息，然后电话或者QQ联系您说订单出现异常，然后发链接给您，让您通过链接取消订单或者提供退款银行，请千万不要相信，如果有任何疑问欢迎联系我们为您核实的，麻烦您提供骗子电话诈骗号码或QQ信息反馈我们收集排查的\n小翠	2015-05-20 12:08:41\n优购网不会以任何丢单、缺货、系统异常等名义获取顾客的银行账号信息、私人QQ、邮箱等；我们外呼统一的客服热线是0755-29757000或61959899，其它联系方式均非优购官方客服。请您妥善处理任何以优购客服名义的问题，建议您遇到类似情况，请拨打优购网官方客服热线4001638888进行验证！\n我	2015-05-20 12:08:57\n他们一定是用了改号软件 显示的来电号码是400-163-8888\n小翠	2015-05-20 12:09:35\n这个我不是很了解诈骗分子使用的是什么方法的呢\n\n</pre>',	'utf-8'),
