(154,	'\n== 项目重构 ==\n[[:Category:软件开发/Android/删除项目中无用的资源|删除项目中无用的资源]]\n\n== Q&A ==\n* [[:Category:软件开发/Android/更改应用默认语言|更改应用默认语言]]\n* [http://www.nextcomputers.org/NeXTfiles/Software/WebObjects/Guides/PortingObjectiveCtoJava.pdf Porting Objective-C to Java]\n* [http://www.wikihow.com/Edit-the-Contents-of-a-.Jar-File-on-a-Mac How to Edit the Contents of a .Jar File on a Mac]\n\n== IDE ==\n* Eclipse\n* Android Studio\n\n从 Eclipse 切换到 Android Studio，最不方便的地方在于快捷键。可以在 Android Studio 设置类似 Eclipse 的快捷键（Preference => Keymap）。\n* 显示类成员和方法：File Structure\n\n[[Category:软件开发]]',	'utf-8'),
(155,	'\n== 项目重构 ==\n[[:Category:软件开发/Android/删除项目中无用的资源|删除项目中无用的资源]]\n\n== Q&A ==\n* [[:Category:软件开发/Android/更改应用默认语言|更改应用默认语言]]\n* [http://www.nextcomputers.org/NeXTfiles/Software/WebObjects/Guides/PortingObjectiveCtoJava.pdf Porting Objective-C to Java]\n* [http://www.wikihow.com/Edit-the-Contents-of-a-.Jar-File-on-a-Mac How to Edit the Contents of a .Jar File on a Mac]\n\n== IDE ==\n* Eclipse\n* Android Studio\n\n从 Eclipse 切换到 Android Studio，最不方便的地方在于快捷键。可以在 Android Studio 设置类似 Eclipse 的快捷键（Preference => Keymap）。\n* 显示类成员和方法：File Structure\n* 搜索 Java Class：Main menu | Navigate | Class...\n\n[[Category:软件开发]]',	'utf-8'),
(156,	'Xtercher \n\n== 原型 ==\nhttp://www.labnuts.cn/mobileapp/frame.html\n\n== 服务端开发任务 ==\n* 设置当前登录用户的推送昵称：http://www.easemob.com/docs/android/setnickname/，对应的 REST API 应该是 http://www.easemob.com/docs/rest/userapi/#nickname Android 用户登录之后，服务端做一次调用。\n\n== 协议文档 ==\n\n登录接口：http://xtecher.com/Wap/UserAccount/loginPage\n\n* HomePage（即第一个tab）对应页面url http://xtecher.com/Wap/ProjectList/index\n* Discover(第二个tab）对应的页面url http://xtecher.com/Wap/Discover/index\n* My profile（第四个tab）对应的页面url http://xtecher.com/Wap/Profile/my\n\n== FriendsList  ==\n\n接口：\nhttp://xtecher.com/Wap/Client/getFriendsList?token=xxxxxx\n\n返回数据示例：\nstatus = 1代表正常状态\ndata中包含一个数组，数组中是好友信息，其中avator是头像链接，name是用户名，job_title和company_name共同组成好友列表页名字下方的description信息，具体你可以参照一下UI图。有不明之处随时问我，辛苦了，thanks。\n{\"data\":[{\"uid\":\"8\",\"name\":\"Ping\",\"job_title\":\"Product Designer\",\"company_name\":\"Xtecher\",\"avator\":\"http:\\/\\/xtecher.com\\/Uploads\\/Avator\\/552ce21d9a697.jpg\"}],\"status\":1}\n\n== Check Token ==\n\ntoken可使用之前的登录接口通过登录操作来生成。\n\n接口：\n\nhttp://xtecher.com/Wap/UserAccount/checkToken?token={token}\n\n正确返回示例：\n{\"data\":{\"uid\":\"1\",\"name\":\"ZhangKai\",\"pinyin\":\"ZhangKai\",\"pinyin_index\":\"Z\",\"sex\":\"0\",\"email\":\"\",\"job_title\":\"CTO\",\"company_name\":\"Baidu\",\"head_img\":\"553683d0b26c1.jpg\",\"id_authorization\":\"0\",\"location_id\":\"0\",\"linked_in\":\"\",\"wechat\":\"aaa\",\"weibo\":\"\",\"tinyurl\":\"\",\"location\":null,\"huanxinpwd\":\"123456\"},\"status\":1}\n其中 uid等于环信用户名，huanxinpwd为环信密码\n\n无效token返回示例：\n\n{\"data\":\"invalid token\",\"status\":0}\n== 客户端调 Native 协议==\n\n=== 登录 ===\n* 使用测试账号正确调用该接口提交登录信息后，浏览器url将被改变为 xtecher://{uid}/{name}/{token}/{环信密码}  ，其中uid是用户在xtecher系统中的uid，不可变，用户的环信id也直接使用此uid进行注册，二者内容相等。name是用户在xtecher系统中的昵称，随时可能被用户更改。\n\n=== 聊天 ===\n* xtecher://chat/{uid}/\n\n=== 设置 ===\n* xtecher://settting\n\n=== 修改头像 ===\n* xtecher://uploadavatar\n\n== 测试帐号 ==\n\n* apptest@xtecher.com 123456\n* apptest2@xtecher.com 123456',	'utf-8'),
(157,	'== iOS Dev Center ==\nhttps://developer.apple.com/devcenter/ios/index.action\n\n== 教程 ==\n* http://objc.io/\n* http://www.raywenderlich.com/\n\n== 证书 ==\n* 创建 APNS 推送证书 [http://www.raywenderlich.com/32960/apple-push-notification-services-in-ios-6-tutorial-part-1 Apple Push Notification Services in iOS 6 Tutorial: Part 1/2]\n\n== SDK ==\n\n=== iOS7 ===\niOS 对状态栏 (Status Bar)、导航栏(Navigation Bar) 做了很大的改造，设计美感提升很多，给开发者带来的问题也很多。\n\n* iOS7 下修改状态栏颜色 [http://stackoverflow.com/questions/17678881/how-to-change-status-bar-text-color-in-ios-7 How to change Status Bar text color in iOS 7]\n* <code>- preferredStatusBarStyle</code> 无法修改状态栏颜色，其中存在 UINavigationController 的时候需要单独处理 [http://stackoverflow.com/questions/19022210/preferredstatusbarstyle-isnt-called preferredStatusBarStyle isn\'t called]\n* 导航栏颜色失真、泛白 [http://stackoverflow.com/questions/18177010/how-to-change-navigation-bar-color-in-ios-7-or-6 Get the right color in iOS7 translucent navigation bar]\n\n=== UITabBarController ===\n\n<code>UITabBarController</code> 自带了 <code>UITabBar</code> 视图。使用的时候，不应该直接管理 <code>UITabBar</code> 的 items。而应该用 <code>UITabBarController</code> 提供的  <code>-  (void)setViewControllers</code> 系列方法。\n\n== 活跃的开发者 ==\n* [http://www.devtang.com/ 唐巧]\n\n[[Category:软件开发]]',	'utf-8'),
(158,	'Xtercher \n\n== 原型 ==\nhttp://www.labnuts.cn/mobileapp/frame.html\n\n== 服务端开发任务 ==\n* 设置当前登录用户的推送昵称：http://www.easemob.com/docs/android/setnickname/，对应的 REST API 应该是 http://www.easemob.com/docs/rest/userapi/#nickname Android 用户登录之后，服务端做一次调用。\n\n== 协议文档 ==\n\n登录接口：http://xtecher.com/Wap/UserAccount/loginPage\n\n* HomePage（即第一个tab）对应页面url http://xtecher.com/Wap/ProjectList/index\n* Discover(第二个tab）对应的页面url http://xtecher.com/Wap/Discover/index\n* My profile（第四个tab）对应的页面url http://xtecher.com/Wap/Profile/my\n\n== FriendsList  ==\n\n接口：\nhttp://xtecher.com/Wap/Client/getFriendsList?token=xxxxxx\n\n返回数据示例：\nstatus = 1代表正常状态\ndata中包含一个数组，数组中是好友信息，其中avator是头像链接，name是用户名，job_title和company_name共同组成好友列表页名字下方的description信息，具体你可以参照一下UI图。有不明之处随时问我，辛苦了，thanks。\n{\"data\":[{\"uid\":\"8\",\"name\":\"Ping\",\"job_title\":\"Product Designer\",\"company_name\":\"Xtecher\",\"avator\":\"http:\\/\\/xtecher.com\\/Uploads\\/Avator\\/552ce21d9a697.jpg\"}],\"status\":1}\n\n== Check Token ==\n\ntoken可使用之前的登录接口通过登录操作来生成。\n\n接口：\n\nhttp://xtecher.com/Wap/UserAccount/checkToken?token={token}\n\n正确返回示例：\n{\"data\":{\"uid\":\"1\",\"name\":\"ZhangKai\",\"pinyin\":\"ZhangKai\",\"pinyin_index\":\"Z\",\"sex\":\"0\",\"email\":\"\",\"job_title\":\"CTO\",\"company_name\":\"Baidu\",\"head_img\":\"553683d0b26c1.jpg\",\"id_authorization\":\"0\",\"location_id\":\"0\",\"linked_in\":\"\",\"wechat\":\"aaa\",\"weibo\":\"\",\"tinyurl\":\"\",\"location\":null,\"huanxinpwd\":\"123456\"},\"status\":1}\n其中 uid等于环信用户名，huanxinpwd为环信密码\n\n无效token返回示例：\n\n{\"data\":\"invalid token\",\"status\":0}\n== 客户端调 Native 协议==\n\n=== 登录 ===\n* 使用测试账号正确调用该接口提交登录信息后，浏览器url将被改变为 xtecher://{uid}/{name}/{token}/{环信密码}  ，其中uid是用户在xtecher系统中的uid，不可变，用户的环信id也直接使用此uid进行注册，二者内容相等。name是用户在xtecher系统中的昵称，随时可能被用户更改。\n\n=== 聊天 ===\n* xtecher://chat/{uid}/\n\n=== 设置 ===\n* xtecher://setting\n\n=== 修改头像 ===\n* xtecher://uploadavatar\n\n== 测试帐号 ==\n\n* apptest@xtecher.com 123456\n* apptest2@xtecher.com 123456',	'utf-8'),
(159,	'\'\'\'Hi 你可以在这里整理、分享知识，添加你认为有用的内容 ：）\'\'\'\n\n== 原则 ==\n说几个词条编辑原则：\n\n* 词条的 title 为树形结构，有子分类的 title ，需要加前缀 “ Category:”，比如 [[:Category:计算机/编程语言]]\n* 非原创的内容，尽量放链接，但是需要添加链接内容描述。词条内容不仅仅包括定义，可以涵盖不同属性，参考 [[:Category:软件开发/iOS]] 。\n* 跟自己的工作或者生活相关，能对他人有帮助的信息，信息越直观越好，有图片、视频的优先展示\n* 地域性差异比较大的内容，建议在城市大类里面分散编辑，比如吃喝玩乐\n* 公共分类，尽量保持客观中立。如果想表达个人观点，把 title 格式设置为 User:$yourname/$title，例如 [[User:Root/北京房价]]\n\n== 技术 ==\n[[File:TechEditorWechatGroup.jpg|200px|thumb|right|技术类编辑微信群]]\n\n* [[:Category:计算机]]\n* [[:Category:软件开发]]\n* [[:Category:开源软件]]\n* [[:Category:操作系统]]\n\n有兴趣编辑技术类词条的朋友，可以加微信群：\n\n== 生活 ==\n* [[:Category:北京市]]\n* [[:Category:杭州市]]\n* [[:Category:玩具]]\n* [[:Category:电子游戏]]\n* [[:Category:400电话/诈骗]]\n* [[:Category:隐私保护]]\n\n== 参考信息 ==\n* [[中国人口统计]]\n\n== 艺术 ==\n* [[音乐制作软件]]\n\n== 入门 ==\n* [//zh.wikipedia.org/wiki/Help:编辑页面 MediaWiki编辑语法]\n\n== RoomChat ==\nRoomChat产品、功能设计：[[RoomChat]]',	'utf-8'),
