(185,	'用户登录\nhttps://api.drughelper.com/user/signin.json\nuserid\n{\n    \"status\" :  \n    \"groups\": [\n     {\n        \"id\": 2210122500120063000,\n        \"name\": \"大学同学\",\n        \"member_count\": 41,\n        \"description\": \"\",\n        \"mask_id\": 123,\n        \"mask_name\": \"test\",\n        \"owner_id\": 1245,\n        \"owner_name\": \"test\",\n        \"create_time\": \"Sat Dec 25 14:12:35 +0800 2010\"\n    } ]\n}\n药品查询\nhttps://api.drughelper.com/drug/druginfo.json\nuserid\nbarcode\n{\n    \"status\" ：\n    \"groups\"：[\n    { \n        \"drug_id\"\n        \"drug_name\"\n        \"manu\"\n        \"img\"\n        \"price\"\n        \"instruction\"\n        \"\"\n}\n添加计划\nhttps://api.drughelper.com/drug/addplan.json?\nuserid\ndrug_id\ncycle\ntake\nstart\ndose\n{\n    \"status\"\n    \"plan_id\"\n}\n\n添加服药记录\nhttps://api.drughelper.com/drug/record.json?\nuserid\nplan_id\ntake_time\ncondition\nmemo\nmemo_audio\n{\n    \"status\"\n    \"record_id\"\n}\n\n社区功能\n发帖\nhttps://api.drughelper.com/social/post.json?\nuserid\ntitle\ncontent\nreply\ngood\nimg\n{\n    \"status\"\n    \"postid\"\n}\n\n回帖\nhttps://api.drughelper.com/social/reply.json?\nuserid\npostid\ntargetid  #回帖目标id\ncontent\n{\n    \"status\"\n    \"replyid\"\n}\n点赞\nhttps://api.drughelper.com/social/good.json?\nuserid\npostid\n{\n    \"status\"\n}\n\n帖子列表\nhttps://api.drughelper.com/social/post_list.json?\nuserid\nfrom_pid\n{\n    \"status\"\n    post_num\n    \"groups\" [\n        postid\n        userid\n        title\n        content\n        reply\n        good\n         img\n         post_time\n    ]\n}\n\n回帖列表\nhttps://api.drughelper.com/social/reply_list.json?\nuserid\npostid\nfrom_replyid\n{\n    \"status\"\n    reply_num\n    \"groups\" [\n        postid\n        userid\n        targetid\n        content\n         reply_time\n    ]\n}',	'utf-8'),
