(189,	'\n== 项目重构 ==\n[[:Category:软件开发/Android/删除项目中无用的资源|删除项目中无用的资源]]\n\n== Q&A ==\n* [[:Category:软件开发/Android/更改应用默认语言|更改应用默认语言]]\n* [http://www.nextcomputers.org/NeXTfiles/Software/WebObjects/Guides/PortingObjectiveCtoJava.pdf Porting Objective-C to Java]\n* [http://www.wikihow.com/Edit-the-Contents-of-a-.Jar-File-on-a-Mac How to Edit the Contents of a .Jar File on a Mac]\n\n== IDE ==\n* Eclipse\n* Android Studio\n\n从 Eclipse 切换到 Android Studio，最不方便的地方在于快捷键。可以在 Android Studio 设置类似 Eclipse 的快捷键（Preference => Keymap）。\n* 显示类成员和方法：File Structure\n* 搜索 Java Class：Main menu | Navigate | Class...\n\n== 第三方工具 ==\n* 崩溃统计 [[:Category:软件开发/Android/Crashlytics|Fabric/Crashlytics]]\n\n[[Category:软件开发]]',	'utf-8'),
(190,	'\n== 项目重构 ==\n[[:Category:软件开发/Android/删除项目中无用的资源|删除项目中无用的资源]]\n\n== Q&A ==\n* [[:Category:软件开发/Android/更改应用默认语言|更改应用默认语言]]\n* [http://www.nextcomputers.org/NeXTfiles/Software/WebObjects/Guides/PortingObjectiveCtoJava.pdf Porting Objective-C to Java]\n* [http://www.wikihow.com/Edit-the-Contents-of-a-.Jar-File-on-a-Mac How to Edit the Contents of a .Jar File on a Mac]\n\n== IDE ==\n* Eclipse\n* Android Studio\n\n从 Eclipse 切换到 Android Studio，最不方便的地方在于快捷键。可以在 Android Studio 设置类似 Eclipse 的快捷键（Preference => Keymap）。\n* 显示类成员和方法：File Structure\n* 搜索 Java Class：Main menu | Navigate | Class...\n\n== 第三方工具 ==\n* 崩溃统计 [[:Category:软件开发/Android/Fabric|Fabric/Crashlytics]]\n\n[[Category:软件开发]]',	'utf-8'),
(191,	'Crashlytics 已被 Twitter 收购，并入 Fabric。\n\n这里主要介绍 Andorid Studio 下使用 Fabric 的一些技巧和注意事项。\n\n==使用技巧==\n\n=== 清除 Fabric 插件本地缓存 ===\n\nFabric 的 Andorid Studio 插件没有一个退出、切换账号的功能。卸载插件之后还是之前登陆的账号。要想切换账号，得删除本地缓存：\n\n<code>rm -rf ~/Library/Caches/com.crashlytics</code>\n\n==注意事项==\n\n* <code>Fabric.with()</code> 方法不能调用多次，因为只有第一次调用是有效的。点进去看一下实现就知道为什么了。\n* 崩溃统计工具只能有一个。崩溃处理是通过 <code>Thread.setDefaultUncaughtExceptionHandler(UncaughtExceptionHandler handler)</code>，看起来并不支持多个 handler，所以只有最后一个注册的 handler 才会生效。',	'utf-8'),
(192,	'Crashlytics 已被 Twitter 收购，并入 Fabric。\n\n这里主要介绍 Andorid Studio 下使用 Fabric 的一些技巧和注意事项。\n\n==使用技巧==\n\n=== 清除 Fabric 插件本地缓存 ===\n\nFabric 的 Andorid Studio 插件没有一个退出、切换账号的功能。卸载插件之后还是之前登陆的账号。要想切换账号，得删除本地缓存：\n\n<code>rm -rf ~/Library/Caches/com.crashlytics</code>\n\n==注意事项==\n\n* <code>Fabric.with()</code> 方法不能调用多次，因为只有第一次调用是有效的。点进去看一下实现就知道为什么了 (Fabric 没有源代码，不过Android Studio 现在有了自带的 decompiler)。\n* 崩溃统计工具只能有一个。崩溃处理是通过 <code>Thread.setDefaultUncaughtExceptionHandler(UncaughtExceptionHandler handler)</code>，看起来并不支持多个 handler，所以只有最后一个注册的 handler 才会生效。',	'utf-8'),
(193,	'=== 红包分享 ===\n* Arcanin送你高达$10 购物现金，快来领！\n* Arcanin дарит Вам сертификат на $10. Спешите получить!@snapone\n\n=== 商品分享（有折扣的商品） === \n* 30%OFF，原价$399仅需$199的xxxx，推荐给你快来购买！\n* Скидка 30%! ххх всего за $199 вместо $399. Спешите!!@snapone\n\n=== 商品分享（无折扣商品） === \n* 仅需$199的xxxx，推荐给你快来购买！\n* хххх всего за $199. Спешите!!@snapone\n\n=== 分享App === \n* SnapOne购物，正品低价！\n* SnapOne - это гарантия отличного качества и низких цен!',	'utf-8'),
