(224,	'可以在这里找到一些公开的网络账号。可用于个人的隐私保护。http://liruqi.info/post/59185719696/publish-my-skype-account\n\n各位有不用的账号，欢迎删除其中个人信息，共享出来。',	'utf-8'),
(225,	'可以在这里找到一些公开的网络账号。可用于个人的隐私保护。http://liruqi.info/post/59185719696/publish-my-skype-account\n\n各位有不用的账号，欢迎删除其中个人信息，共享出来。其中，http://justdelete.me/ 里不可删除的账号建议优先共享。',	'utf-8'),
(226,	'==数据备份==\n* 计划每天把数据库 dump 成文本格式提交到 github，这样可以方便用户用户关注内容变更。\n* 可以通过 github 提交 PR 来更新 wiki。\n\n==Social==\n* 每个词条展示创建者，贡献者\n* 用户可以关注此条，首页 timeline 显示被关注词条的变更\n* 大的词条类别，可以展示即时讨论的界面\n\n[[RoomChat/更新日志]]',	'utf-8'),
(227,	'==数据备份==\n* 计划每天把数据库 dump 成文本格式提交到 github，这样可以方便用户用户关注内容变更。\n* 可以通过 github 提交 PR 来更新 wiki。\n\n==Social==\n* 每个词条展示创建者，贡献者\n* 用户可以关注此条，首页 timeline 显示被关注词条的变更\n* 大的词条类别，可以展示即时讨论的界面\n\n==编辑==\n词条修改不能即时生效，至少需要一位贡献者 approve 才可以。\n\n[[RoomChat/更新日志]]',	'utf-8'),
(228,	'==数据备份==\n* 计划每天把数据库 dump 成文本格式提交到 github，这样可以方便用户用户关注内容变更。\n* 可以通过 github 提交 PR 来更新 wiki。\n\n==Social==\n* 每个词条展示创建者，贡献者\n* 用户可以关注此条，首页 timeline 显示被关注词条的变更\n* 大的词条类别，可以展示即时讨论的界面\n\n==编辑==\n* 词条修改不能即时生效，至少需要一位贡献者 approve 才可以。\n\n[[RoomChat/更新日志]]',	'utf-8'),
