(235,	'Xtercher \n\n* 原型 http://www.labnuts.cn/mobileapp/frame.html\n* 资源 http://nav.liruqi.info/video/xtecher/\n* iOS  http://www.pgyer.com/xtecher\n* Android http://www.pgyer.com/NqIv\n\n==进度==\n* 第二周群聊功能基本开发完成\n* iOS 需要处理群聊中，新成员加入后，没有昵称和头像的问题\n\n==6月开发需求==\nby Ping\n\n第一周 Setting等其他需native处理的地方 # 5月30日周六晚上10点前安卓iOS各打一个包\n\n>> 一些小的UI细节，例如底部Tab选中时的颜色等\n\n第二周 群聊集成与其他 # 预计6月7日周日晚上9点前安卓iOS各打一个包\n\n>> 添加群聊功能\n\n>> 第一个和第二个 tab，点进详情页之后，隐藏底部 tabbar，回首页之后再显示 tabbar / Share&Comment按钮位置下移\n\n>> 聊天对话页，右上角的垃圾桶icon 改为 “。。。”，实际功能为添加人创建群聊，report、block\n\n>> 集成微信分享SDK，调试接口并实现微信分享功能（微信公众平台已通过认证）\n\n第三周 细调UI界面 ＃6月13日周六晚上10点前安卓iOS各打一个包\n\n>> 实现各页面间切换时的动效\n\n>> 图标更换：通讯录Followings的入口图标，聊天对话文字输入框两端的icon，麦克风、表情、加号，聊天对话的发图、拍摄、发位置3个icon（iOS已改，安卓还没）\n\n>> 图标颜色：顶部导航栏的颜色，请自行核对设计图的全部导航栏icon，例如项目详情页顶部导航栏的五角星选中时是主蓝色，现在的蓝不太对，返回<按钮的颜色与形状也各不相同\n\n>> 页面颜色：按照聊天列表页、联系人页、聊天对话页的UI设计细调聊天窗口的配色等元素\n\n>> 头像形状：聊天列表页与聊天对话页的用户头像请参照UI图，圆形\n\n>> 集成一个下载接口，网站端通过接口通知App端，App端为用户下载一个指定url的资源\n\n>> 集成友盟统计，未来上线后可供运营人员查看每日数据\n\n== 服务端开发任务 ==\n* 设置当前登录用户的推送昵称：http://www.easemob.com/docs/android/setnickname/ ，对应的 REST API 应该是 http://www.easemob.com/docs/rest/userapi/#nickname Android 用户登录之后，服务端做一次调用。\n\n== 客户端接口调用协议 ==\n\n* 登录接口：http://xtecher.com/Wap/UserAccount/loginPage\n* 它人Profile 页面：http://xtecher.com/Wap/Profile/view?uid=100198\n* HomePage（即第一个tab）对应页面url http://xtecher.com/Wap/ProjectList/index\n* Discover(第二个tab）对应的页面url http://xtecher.com/Wap/Discover/index\n* My profile（第四个tab）对应的页面url http://xtecher.com/Wap/Profile/my\n* Chat页访问其他人的profile对应的url http://xtecher.com/Wap/Profile/fromchat?uid=100001\n\n公告参数：\n* token: 登陆接口返回\n* lang: zh/tw/en\n\n=== FriendsList ===\n\n接口：\nhttp://xtecher.com/Wap/Client/getFriendsList?token=xxxxxx\n\n返回数据示例：\nstatus = 1代表正常状态\ndata中包含一个数组，数组中是好友信息，其中avator是头像链接，name是用户名，job_title和company_name共同组成好友列表页名字下方的description信息，具体你可以参照一下UI图。有不明之处随时问我，辛苦了，thanks。\n{\"data\":[{\"uid\":\"8\",\"name\":\"Ping\",\"job_title\":\"Product Designer\",\"company_name\":\"Xtecher\",\"avator\":\"http:\\/\\/xtecher.com\\/Uploads\\/Avator\\/552ce21d9a697.jpg\"}],\"status\":1}\n\n=== Check Token ===\n\ntoken可使用之前的登录接口通过登录操作来生成。\n\n接口：\n\nhttp://xtecher.com/Wap/UserAccount/checkToken?token={token}\n\n正确返回示例：\n{\"data\":{\"uid\":\"1\",\"name\":\"ZhangKai\",\"pinyin\":\"ZhangKai\",\"pinyin_index\":\"Z\",\"sex\":\"0\",\"email\":\"\",\"job_title\":\"CTO\",\"company_name\":\"Baidu\",\"head_img\":\"553683d0b26c1.jpg\",\"id_authorization\":\"0\",\"location_id\":\"0\",\"linked_in\":\"\",\"wechat\":\"aaa\",\"weibo\":\"\",\"tinyurl\":\"\",\"location\":null,\"huanxinpwd\":\"123456\"},\"status\":1}\n其中 uid等于环信用户名，huanxinpwd为环信密码\n\n无效token返回示例：\n\n{\"data\":\"invalid token\",\"status\":0}\n\n=== 上传头像 ===\n\nhttp://xtecher.com/Wap/User/uploadAvatar?token=xxxx&client=ios&lang=en\n\n参数：以post形式上传一个图片对象\n\n返回：错误json {status：0}，成功 json {status：1}\n\n=== 举报 ===\n\n举报某用户：\nhttp://xtecher.com/Common/Report/reportUser?uid=xxx\n\n举报某个群\nhttp://xtecher.com/Common/Report/reportGroup?group_id=xxx\n\n== 客户端调 Native 协议==\n\n=== 登录 ===\n* 使用测试账号正确调用该接口提交登录信息后，浏览器url将被改变为 xtecher://{uid}/{name}/{token}/{环信密码}  ，其中uid是用户在xtecher系统中的uid，不可变，用户的环信id也直接使用此uid进行注册，二者内容相等。name是用户在xtecher系统中的昵称，随时可能被用户更改。\n\n=== 聊天 ===\n* xtecher://chat/{uid}/\n* xtecher://chatroom （这是从个人页回到聊天室的入口）\n\n=== 设置 ===\n* xtecher://setting\n\n=== 修改头像 ===\n* xtecher://uploadavatar\n\n===  分享 ===\n* xtecher://wechatshare/moments?title=xxx&description=yyy&url=zzz&image=xtecher.com/news.jpg\n* xtecher://wechatshare/contacts?title=xxx&description=yyy&url=zzz&image=xtecher.com/news.jpg\n* image 参数可选\n\n== 测试帐号 ==\n\n* apptest@xtecher.com 123456\n* apptest2@xtecher.com 123456\n\n== Create Post接口 == \nby zhangkai 0531\n\n先将图片逐张提交到此接口（提交方法同头像上传），此接口为公开接口，无需token亦可调用\n\nhttp://xtecher.com/Common/Upload/imageNoCrop\n\n如正确提交，则返回数据示例：\n\n{\"data\":\"{\\\"name\\\":\\\"101001.jpg\\\",\\\"type\\\":\\\"image\\\\\\/jpeg\\\",\\\"size\\\":6298,\\\"key\\\":\\\"file_img\\\",\\\"extension\\\":\\\"jpg\\\",\\\"savepath\\\":\\\".\\\\\\/Uploads\\\\\\/\\\",\\\"savename\\\":\\\"20150531\\\\\\/556ab9a7c041b.jpg\\\",\\\"hash\\\":\\\"6ae036f9a9fc78016f0b94992d4f288a\\\"}\",\"status\":1}\n\n其中data.savename为需要记录并保存的信息，等下提交post的整体数据时候需要用到\n\n待用户填完post的内容，点击publish按钮时，提交如下信息：\n\npics:20150531/556ab9a7c041b.jpg,20150531/556abac5262f8.jpg\n\n如果有一张图，则提交pics:20150531/556ab9a7c041b.jpg  两张图则将两张图的savename用英文逗号分隔后提交，至多提交5张图\n\ncontent:123   123是用户发表的文本内容\n\n提交到\n\nhttp://xtecher.com/Wap/Post/createPostSubmit 接口，调用这个接口时候需要带token以识别身份\n\n== ClientJS接口 == \n\n调用ClientJS.xxx() 即可与网页脚本通信\n\n刷新discover的接口：\n\nClientJS.refreshDiscover();',	'utf-8'),
(236,	'== 学习资源 ==\n* [http://developer.android.com/develop/index.html Develop Apps | Android Developers]\n\n== 项目重构 ==\n[[:Category:软件开发/Android/删除项目中无用的资源|删除项目中无用的资源]]\n\n== Q&A ==\n* [[:Category:软件开发/Android/更改应用默认语言|更改应用默认语言]]\n* [http://www.nextcomputers.org/NeXTfiles/Software/WebObjects/Guides/PortingObjectiveCtoJava.pdf Porting Objective-C to Java]\n* [http://www.wikihow.com/Edit-the-Contents-of-a-.Jar-File-on-a-Mac How to Edit the Contents of a .Jar File on a Mac]\n\n== IDE ==\n* Eclipse\n* Android Studio\n\n从 Eclipse 切换到 Android Studio，最不方便的地方在于快捷键。可以在 Android Studio 设置类似 Eclipse 的快捷键（Preference => Keymap）。\n* 显示类成员和方法：File Structure\n* 搜索 Java Class：Main menu | Navigate | Class...\n\n== 第三方工具 ==\n* 崩溃统计 [[:Category:软件开发/Android/Fabric|Fabric/Crashlytics]]\n\n\n== 第三方SDK ==\n=== VK ===\n* VK SDK 有可能授权之后无反应，可以尝试把 <code>VKSdk.authorize(scope, true, false);</code> 改为 <code>VKSdk.authorize(scope, false, true);</code> 参考 https://github.com/VKCOM/vk-android-sdk/issues/80\n\n[[Category:软件开发]]',	'utf-8'),
(237,	'这里说一些语言特征。\n\n== 容器对象的深拷贝 ==\n\n因为容器对象的每个 item 可能是别的容器对象。考虑到层级关系，有一个一层深拷贝的方法：\n\n<code> NSArray *deepCopyArray=[[NSArray alloc] initWithArray:someArray copyItems:YES]; </code>\n\n如果要做到真正的深拷贝，需要要求容器内所有对象实现 NSCoding 协议：\n\n<code>NSArray* trueDeepCopyArray = [NSKeyedUnarchiver unarchiveObjectWithData: [NSKeyedArchiver archivedDataWithRootObject:oldArray]]; </code>\n\n相当于先序列化然后反序列化。\n\n如果不能保证所有对象实现 NSCoding 协议，就无法序列化容器对象，也无法一行代码做到深拷贝。\n\n另外一个苹果文档没有写的思路，就是给 NSObject 写一个 Category，对容器每个对象实现一个深拷贝的方法。\n\n参考：\n* https://developer.apple.com/library/mac/documentation/Cocoa/Conceptual/Collections/Articles/Copying.html\n* http://stackoverflow.com/questions/647260/deep-copying-an-nsarray',	'utf-8'),
(238,	'这里说一些 Objective-C 语言和 iOS 平台特征。\n\n== 容器对象的深拷贝 ==\n\n因为容器对象的每个 item 可能是别的容器对象。考虑到层级关系，有一个一层深拷贝的方法：\n\n<code> NSArray *deepCopyArray=[[NSArray alloc] initWithArray:someArray copyItems:YES]; </code>\n\n如果要做到真正的深拷贝，需要要求容器内所有对象实现 NSCoding 协议：\n\n<code>NSArray* trueDeepCopyArray = [NSKeyedUnarchiver unarchiveObjectWithData: [NSKeyedArchiver archivedDataWithRootObject:oldArray]]; </code>\n\n相当于先序列化然后反序列化。\n\n如果不能保证所有对象实现 NSCoding 协议，就无法序列化容器对象，也无法一行代码做到深拷贝。\n\n另外一个苹果文档没有写的思路，就是给 NSObject 写一个 Category，对容器每个对象实现一个深拷贝的方法。\n\n参考：\n* https://developer.apple.com/library/mac/documentation/Cocoa/Conceptual/Collections/Articles/Copying.html\n* http://stackoverflow.com/questions/647260/deep-copying-an-nsarray',	'utf-8'),
