/\\/xtecher.com\\/Uploads\\/Avator\\/552ce21d9a697.jpg\"}],\"status\":1}\n\n=== Check Token ===\n\ntoken可使用之前的登录接口通过登录操作来生成。\n\n接口：\n\nhttp://xtecher.com/Wap/UserAccount/checkToken?token={token}\n\n正确返回示例：\n{\"data\":{\"uid\":\"1\",\"name\":\"ZhangKai\",\"pinyin\":\"ZhangKai\",\"pinyin_index\":\"Z\",\"sex\":\"0\",\"email\":\"\",\"job_title\":\"CTO\",\"company_name\":\"Baidu\",\"head_img\":\"553683d0b26c1.jpg\",\"id_authorization\":\"0\",\"location_id\":\"0\",\"linked_in\":\"\",\"wechat\":\"aaa\",\"weibo\":\"\",\"tinyurl\":\"\",\"location\":null,\"huanxinpwd\":\"123456\"},\"status\":1}\n其中 uid等于环信用户名，huanxinpwd为环信密码\n\n无效token返回示例：\n\n{\"data\":\"invalid token\",\"status\":0}\n\n=== 上传头像 ===\n\nhttp://xtecher.com/Wap/User/uploadAvatar?token=xxxx&client=ios&lang=en\n\n参数：以post形式上传一个图片对象\n\n返回：错误json {status：0}，成功 json {status：1}\n\n=== 举报 ===\n\n举报某用户：\nhttp://xtecher.com/Common/Report/reportUser?uid=xxx\n\n举报某个群\nhttp://xtecher.com/Common/Report/reportGroup?group_id=xxx\n\n== 客户端调 Native 协议==\n\n=== 登录 ===\n* 使用测试账号正确调用该接口提交登录信息后，浏览器url将被改变为 xtecher://{uid}/{name}/{token}/{环信密码}  ，其中uid是用户在xtecher系统中的uid，不可变，用户的环信id也直接使用此uid进行注册，二者内容相等。name是用户在xtecher系统中的昵称，随时可能被用户更改。\n\n=== 聊天 ===\n* xtecher://chat/{uid}/\n* xtecher://chatroom （这是从个人页回到聊天室的入口）\n\n=== 设置 ===\n* xtecher://setting\n* xtecher://tabbar/hide\n* xtecher://tabbar/show\n\n=== 修改头像 ===\n* xtecher://uploadavatar\n\n===  分享 ===\n* xtecher://wechatshare/moments?title=xxx&description=yyy&url=zzz&image=xtecher.com/news.jpg\n* xtecher://wechatshare/contacts?title=xxx&description=yyy&url=zzz&image=xtecher.com/news.jpg\n* image 参数可选\n\n== 测试帐号 ==\n\n* apptest@xtecher.com 123456\n* apptest2@xtecher.com 123456\n\n== Create Post接口 == \nby zhangkai 0531\n\n先将图片逐张提交到此接口（提交方法同头像上传），此接口为公开接口，无需token亦可调用\n\nhttp://xtecher.com/Common/Upload/imageNoCrop\n\n如正确提交，则返回数据示例：\n\n{\"data\":\"{\\\"name\\\":\\\"101001.jpg\\\",\\\"type\\\":\\\"image\\\\\\/jpeg\\\",\\\"size\\\":6298,\\\"key\\\":\\\"file_img\\\",\\\"extension\\\":\\\"jpg\\\",\\\"savepath\\\":\\\".\\\\\\/Uploads\\\\\\/\\\",\\\"savename\\\":\\\"20150531\\\\\\/556ab9a7c041b.jpg\\\",\\\"hash\\\":\\\"6ae036f9a9fc78016f0b94992d4f288a\\\"}\",\"status\":1}\n\n其中data.savename为需要记录并保存的信息，等下提交post的整体数据时候需要用到\n\n待用户填完post的内容，点击publish按钮时，提交如下信息：\n\npics:20150531/556ab9a7c041b.jpg,20150531/556abac5262f8.jpg\n\n如果有一张图，则提交pics:20150531/556ab9a7c041b.jpg  两张图则将两张图的savename用英文逗号分隔后提交，至多提交5张图\n\ncontent:123   123是用户发表的文本内容\n\n提交到\n\nhttp://xtecher.com/Wap/Post/createPostSubmit 接口，调用这个接口时候需要带token以识别身份\n\n== ClientJS接口 == \n\n调用ClientJS.xxx() 即可与网页脚本通信\n\n刷新discover的接口：\n\nClientJS.refreshDiscover();',	'utf-8'),
(240,	'==商住两用房==\n“商住两用房”，从名字上看，就是既能办公又可以居住的一种产品，但在建筑术语中没有这种称谓，这只是销售方根据市场行情和产品的功能来定义的一个不规范的俗称。\n\n“商住两用”一般是土地用途的概念，即某地块既可以进行商业房屋开发，也可以进行住宅开发。但是建设工程完成后具体到房屋的用途，要么属于商业房屋，要么属于住宅，并不存在商住两用房的法律概念。如果开发商说楼房是\"商住两用\"的，则很可能是：同一幢楼部分是商业的(比较多的是裙房和下面的楼层)，部分是住宅的。房产证的用途写着商品住宅，就是住宅房;未写明商品住宅的也有可能是酒店式公寓、单身公寓等商务办公房。商务办公房与住宅还是有很大区别的。\n\nhttp://mall.fang.com/mall/201407/shangzhuf.html',	'utf-8'),
(242,	'可以在这里找到一些公开的网络账号。可用于个人的隐私保护。原由：http://liruqi.info/post/59185719696/publish-my-skype-account\n\n各位有不用的账号，欢迎删除其中个人信息，共享出来。其中，http://justdelete.me/ 里不可删除的账号建议优先共享。',	'utf-8'),
(243,	'==商住两用房==\n“商住两用房”，从名字上看，就是既能办公又可以居住的一种产品，但在建筑术语中没有这种称谓，这只是销售方根据市场行情和产品的功能来定义的一个不规范的俗称。\n\n“商住两用”一般是土地用途的概念，即某地块既可以进行商业房屋开发，也可以进行住宅开发。但是建设工程完成后具体到房屋的用途，要么属于商业房屋，要么属于住宅，并不存在商住两用房的法律概念。如果开发商说楼房是\"商住两用\"的，则很可能是：同一幢楼部分是商业的(比较多的是裙房和下面的楼层)，部分是住宅的。房产证的用途写着商品住宅，就是住宅房;未写明商品住宅的也有可能是酒店式公寓、单身公寓等商务办公房。商务办公房与住宅还是有很大区别的。\n\nhttp://mall.fang.com/mall/201407/shangzhuf.html\n\n[[Category: 北京市/房地产]]',	'utf-8'),
(244,	'==数据备份==\n* 计划每天把数据库 dump 成文本格式提交到 github，这样可以方便用户用户关注内容变更。\n* 可以通过 github 提交 PR 来更新 wiki。\n\n==Social==\n* 每个词条展示创建者，贡献者\n* 用户可以关注此条，首页 timeline 显示被关注词条的变更\n* 大的词条类别，可以展示即时讨论的界面\n\n==编辑==\n* 词条修改不能即时生效，至少需要一位贡献者 approve 才可以。\n\n==移动客户端==\n移动客户端分几个 Tab，\n* 生活\n* 工作\n* 读书\n* 历史\n* 电影\n* 音乐\n\n每个tab下做子分类。\n\n[[RoomChat/更新日志]]',	'utf-8'),
(245,	'Xtercher \n\n* 原型 http://www.labnuts.cn/mobileapp/frame.html\n* 资源 http://nav.liruqi.info/video/xtecher/\n* iOS  http://www.pgyer.com/xtecher\n* Android http://www.pgyer.com/NqIv\n\n==进度==\n* 第二周群聊功能基本开发完成\n* iOS 需要处理群聊中，新成员加入后，没有昵称和头像的问题\n\n==开发进度==\n第三周 细调UI界面 ＃6月13日周六晚上10点前安卓iOS各打一个包\n\n>> 实现各页面间切换时的动效\n\n>> 图标更换：通讯录Followings的入口图标，聊天对话文字输入框两端的icon，麦克风、表情、加号，聊天对话的发图、拍摄、发位置3个icon（iOS已改，安卓还没）\n\n>> 图标颜色：顶部导航栏的颜色，请自行核对设计图的全部导航栏icon，例如项目详情页顶部导航栏的五角星选中时是主蓝色，现在的蓝不太对，返回<按钮的颜色与形状也各不相同\n\n>> 页面颜色：按照聊天列表页、联系人页、聊天对话页的UI设计细调聊天窗口的配色等元素\n\n>> 集成一个下载接口，网站端通过接口通知App端，App端为用户下载一个指定url的资源\n\n>> 集成友盟统计，未来上线后可供运营人员查看每日数据\n\n== 服务端开发任务 ==\n* 设置当前登录用户的推送昵称：http://www.easemob.com/docs/android/setnickname/ ，对应的 REST API 应该是 http://www.easemob.com/docs/rest/userapi/#nickname Android 用户登录之后，服务端做一次调用。\n\n== 客户端接口调用协议 ==\n\n* 登录接口：http://xtecher.com/Wap/UserAccount/loginPage\n* 它人Profile 页面：http://xtecher.com/Wap/Profile/view?uid=100198\n* HomePage（即第一个tab）对应页面url http://xtecher.com/Wap/ProjectList/index\n* Discover(第二个tab）对应的页面url http://xtecher.com/Wap/Discover/index\n* My profile（第四个tab）对应的页面url http://xtecher.com/Wap/Profile/my\n* Chat页访问其他人的profile对应的url http://xtecher.com/Wap/Profile/fromchat?uid=100001\n\n公告参数：\n* token: 登陆接口返回\n* lang: zh/tw/en\n\n=== FriendsList ===\n\n接口：\nhttp://xtecher.com/Wap/Client/getFriendsList?token=xxxxxx\n\n返回数据示例：\nstatus = 1代表正常状态\ndata中包含一个数组，数组中是好友信息，其中avator是头像链接，name是用户名，job_title和company_name共同组成好友列表页名字下方的description信息，具体你可以参照一下UI图。有不明之处随时问我，辛苦了，thanks。\n{\"data\":[{\"uid\":\"8\",\"name\":\"Ping\",\"job_title\":\"Product Designer\",\"company_name\":\"Xtecher\",\"avator\":\"http:\\/\\/xtecher.com\\/Uploads\\/Avator\\/552ce21d9a697.jpg\"}],\"status\":1}\n\n=== Check Token ===\n\ntoken可使用之前的登录接口通过登录操作来生成。\n\n接口：\n\nhttp://xtecher.com/Wap/UserAccount/checkToken?token={token}\n\n正确返回示例：\n{\"data\":{\"uid\":\"1\",\"name\":\"ZhangKai\",\"pinyin\":\"ZhangKai\",\"pinyin_index\":\"Z\",\"sex\":\"0\",\"email\":\"\",\"job_title\":\"CTO\",\"company_name\":\"Baidu\",\"head_img\":\"553683d0b26c1.jpg\",\"id_authorization\":\"0\",\"location_id\":\"0\",\"linked_in\":\"\",\"wechat\":\"aaa\",\"weibo\":\"\",\"tinyurl\":\"\",\"location\":null,\"huanxinpwd\":\"123456\"},\"status\":1}\n其中 uid等于环信用户名，huanxinpwd为环信密码\n\n无效token返回示例：\n\n{\"data\":\"invalid token\",\"status\":0}\n\n=== 上传头像 ===\n\nhttp://xtecher.com/Wap/User/uploadAvatar?token=xxxx&client=ios&lang=en\n\n参数：以post形式上传一个图片对象\n\n返回：错误json {status：0}，成功 json {status：1}\n\n=== 举报 ===\n\n举报某用户：\nhttp://xtecher.com/Common/Report/reportUser?uid=xxx\n\n举报某个群\nhttp://xtecher.com/Common/Report/reportGroup?group_id=xxx\n\n== 客户端调 Native 协议==\n\n=== 登录 ===\n* 使用测试账号正确调用该接口提交登录信息后，浏览器url将被改变为 xtecher://{uid}/{name}/{token}/{环信密码}  ，其中uid是用户在xtecher系统中的uid，不可变，用户的环信id也直接使用此uid进行注册，二者内容相等。name是用户在xtecher系统中的昵称，随时可能被用户更改。\n\n=== 聊天 ===\n* xtecher://chat/{uid}/\n* xtecher://chatroom （这是从个人页回到聊天室的入口）\n\n=== 设置 ===\n* xtecher://setting\n* xtecher://tabbar/hide\n* xtecher://tabbar/show\n\n=== 修改头像 ===\n* xtecher://uploadavatar\n\n===  分享 ===\n* xtecher://wechatshare/moments?title=xxx&description=yyy&url=zzz&image=xtecher.com/news.jpg\n* xtecher://wechatshare/contacts?title=xxx&description=yyy&url=zzz&image=xtecher.com/news.jpg\n* image 参数可选\n\n== 测试帐号 ==\n\n* apptest@xtecher.com 123456\n* apptest2@xtecher.com 123456\n\n== Create Post接口 == \nby zhangkai 0531\n\n先将图片逐张提交到此接口（提交方法同头像上传），此接口为公开接口，无需token亦可调用\n\nhttp://xtecher.com/Common/Upload/imageNoCrop\n\n如正确提交，则返回数据示例：\n\n{\"data\":\"{\\\"name\\\":\\\"101001.jpg\\\",\\\"type\\\":\\\"image\\\\\\/jpeg\\\",\\\"size\\\":6298,\\\"key\\\":\\\"file_img\\\",\\\"extension\\\":\\\"jpg\\\",\\\"savepath\\\":\\\".\\\\\\/Uploads\\\\\\/\\\",\\\"savename\\\":\\\"20150531\\\\\\/556ab9a7c041b.jpg\\\",\\\"hash\\\":\\\"6ae036f9a9fc78016f0b94992d4f288a\\\"}\",\"status\":1}\n\n其中data.savename为需要记录并保存的信息，等下提交post的整体数据时候需要用到\n\n待用户填完post的内容，点击publish按钮时，提交如下信息：\n\npics:20150531/556ab9a7c041b.jpg,20150531/556abac5262f8.jpg\n\n如果有一张图，则提交pics:20150531/556ab9a7c041b.jpg  两张图则将两张图的savename用英文逗号分隔后提交，至多提交5张图\n\ncontent:123   123是用户发表的文本内容\n\n提交到\n\nhttp://xtecher.com/Wap/Post/createPostSubmit 接口，调用这个接口时候需要带token以识别身份\n\n== ClientJS接口 == \n\n调用ClientJS.xxx() 即可与网页脚本通信\n\n刷新discover的接口：\n\nClientJS.refreshDiscover();',	'utf-8'),
(246,	'== iOS Dev Center ==\nhttps://developer.apple.com/devcenter/ios/index.action\n\n== 教程 ==\n* http://objc.io/\n* http://www.raywenderlich.com/\n\n== 证书 ==\n* 创建 APNS 推送证书 [http://www.raywenderlich.com/32960/apple-push-notification-services-in-ios-6-tutorial-part-1 Apple Push Notification Services in iOS 6 Tutorial: Part 1/2]\n\n== SDK ==\n\n=== iOS7 ===\niOS 对状态栏 (Status Bar)、导航栏(Navigation Bar) 做了很大的改造，设计美感提升很多，给开发者带来的问题也很多。\n\n* iOS7 下修改状态栏颜色 [http://stackoverflow.com/questions/17678881/how-to-change-status-bar-text-color-in-ios-7 How to change Status Bar text color in iOS 7]\n* <code>- preferredStatusBarStyle</code> 无法修改状态栏颜色，其中存在 UINavigationController 的时候需要单独处理 [http://stackoverflow.com/questions/19022210/preferredstatusbarstyle-isnt-called preferredStatusBarStyle isn\'t called]\n* 导航栏颜色失真、泛白，设置 Navigation Bar 的 translucent 属性为 NO。translucent 属性带来的色值转换：[http://stackoverflow.com/questions/18895252/get-the-right-color-in-ios7-translucent-navigation-bar Get the right color in iOS7 translucent navigation bar]\n\n=== UITabBarController ===\n\n<code>UITabBarController</code> 自带了 <code>UITabBar</code> 视图。使用的时候，不应该直接管理 <code>UITabBar</code> 的 items。而应该用 <code>UITabBarController</code> 提供的  <code>-  (void)setViewControllers</code> 系列方法。\n\n== 活跃的开发者 ==\n* [http://www.devtang.com/ 唐巧]\n\n[[Category:软件开发]]',	'utf-8'),
(247,	'Xtercher \n\n== 服务端开发任务 ==\n* 设置当前登录用户的推送昵称：http://www.easemob.com/docs/android/setnickname/ ，对应的 REST API 应该是 http://www.easemob.com/docs/rest/userapi/#nickname Android 用户登录之后，服务端做一次调用。\n\n== 客户端接口调用协议 ==\n域名：http://chat-api.roomchat.im\n\n公告参数：\n* token: 登陆接口返回\n* lang: zh/tw/en\n\n=== FriendsList ===\n\n接口：\nPOST\nPATH: /Wap/Client/getFriendsList?token=xxxxxx\nDATA: contacts=18601240631|18601240632|...|18601240639\n\n返回数据示例：\nstatus = 1代表正常状态\ndata中包含一个数组，数组中是好友信息，其中avator是头像链接，name是用户名，job_title和company_name共同组成好友列表页名字下方的description信息，具体你可以参照一下UI图。有不明之处随时问我，辛苦了，thanks。\n{\"data\":[{\"uid\":\"18601240631\",\"name\":\"Ping\",\"phone\":\"18601240631\",\"job_title\":\"Product Designer\",\"company_name\":\"Xtecher\",\"avator\":\"http:\\/\\/xtecher.com\\/Uploads\\/Avator\\/552ce21d9a697.jpg\"}],\"status\":1}\n\n=== Check Token ===\n\ntoken可使用之前的登录接口通过登录操作来生成。\n\n接口：\n\nhttp://xtecher.com/Wap/UserAccount/checkToken?token={token}\n\n正确返回示例：\n{\"data\":{\"uid\":\"1\",\"name\":\"ZhangKai\",\"pinyin\":\"ZhangKai\",\"phone\":\"18601240631\",\"sex\":\"0\",\"email\":\"\",\"job_title\":\"CTO\",\"company_name\":\"Baidu\",\"head_img\":\"553683d0b26c1.jpg\",\"id_authorization\":\"0\",\"location_id\":\"0\",\"linked_in\":\"\",\"wechat\":\"aaa\",\"weibo\":\"\",\"tinyurl\":\"\",\"location\":null,\"huanxinpwd\":\"123456\"},\"status\":1}\n其中 uid等于环信用户名，huanxinpwd为环信密码\n\n无效token返回示例：\n\n{\"data\":\"invalid token\",\"status\":0}\n\n=== 上传头像 ===\n\nhttp://xtecher.com/Wap/User/uploadAvatar?token=xxxx&client=ios&lang=en\n\n参数：以post形式上传一个图片对象\n\n返回：错误json {status：0}，成功 json {status：1}\n\n=== 举报 ===\n\n举报某用户：\nhttp://xtecher.com/Common/Report/reportUser?uid=xxx\n\n举报某个群\nhttp://xtecher.com/Common/Report/reportGroup?group_id=xxx\n\n=== 登录 ===\nPATH: /Wap/Client/login\nDATA:\nphone=18601240631&passwd=111111\n\n{\"data\":{\"uid\":\"1\",\"name\":\"ZhangKai\",\"pinyin\":\"ZhangKai\",\"phone\":\"18601240631\",\"sex\":\"0\",\"email\":\"\",\"job_title\":\"CTO\",\"company_name\":\"Baidu\",\"head_img\":\"553683d0b26c1.jpg\",\"id_authorization\":\"0\",\"location_id\":\"0\",\"linked_in\":\"\",\"wechat\":\"aaa\",\"weibo\":\"\",\"tinyurl\":\"\",\"location\":null,\"huanxinpwd\":\"123456\"},\n\"token\"=\"1q2w3e4r5t\"\n\"status\":1}\n\n== 测试帐号 ==\n\n* apptest@xtecher.com 123456\n* apptest2@xtecher.com 123456',	'utf-8'),
