(252,	'== Wikipedia ==\n[https://zh.wikipedia.org/wiki/%E9%9B%B2%E7%AB%AF%E9%81%8B%E7%AE%97 云计算]\n\n== 云服务产品 ==\n\n=== 即时通信类 ===\n* [[:Category:软件开发/云服务/环信|环信]]\n* [https://www.firebase.com/ Firebase]\n* [https://telegram.org/ Telegram]\n\n[[Category:软件开发]]',	'utf-8'),
(253,	'Based on https://telegram.org/',	'utf-8'),
(254,	'Telegram 是一个基于手机通讯录的即时通信软件，用起来跟 WhatApp，Messanger 或者微信，没有本质区别。其[https://telegram.org/ 官网]的一句话介绍是：Telegram is a cloud-based mobile and desktop messaging app with a focus on security and speed。但有一个很大的区别在于其平台的开放性。Telegram 开源了所有客户端代码，包括 iOS、Android、Windows Phone 以及 PC 的 Mac OS X，Windows 和 Web。开发者可以在 Telegram 上创建应用，做UI和功能定制的客户端，第三方客户端可以直接跟现有的 Telegram 用户通讯。\n\nTelegram 的用户身份认证也是创造性的极简。注册、登录只需要填写手机号，然后给你手机上发短信验证码，输入验证码即可完成验证步骤。\n\n目前（2015年6月26日）Telegram 的 iOS 代码看起来是2015年1月的打包。编译之后有明显的UI渲染的问题，我做了简单的修复：https://github.com/liruqi/Telegram-iOS',	'utf-8'),
(255,	'Telegram 是一个基于手机通讯录的即时通信软件，用起来跟 WhatApp，Messanger 或者微信，没有本质区别。其[https://telegram.org/ 官网]的一句话介绍是：Telegram is a cloud-based mobile and desktop messaging app with a focus on security and speed。但有一个很大的区别在于其平台的开放性。Telegram 开源了所有客户端代码，包括 iOS、Android、Windows Phone 以及 PC 的 Mac OS X，Windows 和 Web。开发者可以在 Telegram 上创建应用，做UI和功能定制的客户端，在第三方客户端登陆之后，可以直接跟现有的 Telegram 用户通讯。\n\nTelegram 的用户身份认证也是创造性的极简。注册、登录只需要填写手机号，然后给你手机上发短信验证码，输入验证码即可完成验证步骤。\n\n目前（2015年6月26日）Telegram 的 iOS 代码看起来是2015年1月的打包。编译之后有明显的UI渲染的问题，我做了简单的修复：https://github.com/liruqi/Telegram-iOS',	'utf-8'),
(256,	'Telegram 的 [https://en.wikipedia.org/wiki/Telegram_(software) Wikipedia词条]。\n\nTelegram 是一个基于手机通讯录的即时通信软件，用起来跟 WhatApp，Messanger 或者微信，没有本质区别。其[https://telegram.org/ 官网]的一句话介绍是：Telegram is a cloud-based mobile and desktop messaging app with a focus on security and speed。但有一个很大的区别在于其平台的开放性。Telegram 开源了所有客户端代码，包括 iOS、Android、Windows Phone 以及 PC 的 Mac OS X，Windows 和 Web。开发者可以在 Telegram 上创建应用，做UI和功能定制的客户端，在第三方客户端登陆之后，可以直接跟现有的 Telegram 用户通讯。\n\nTelegram 的用户身份认证也是创造性的极简。注册、登录只需要填写手机号，然后给你手机上发短信验证码，输入验证码即可完成验证步骤。\n\n目前（2015年6月26日）Telegram 的 iOS 代码看起来是2015年1月的打包。编译之后有明显的UI渲染的问题，我做了简单的修复：https://github.com/liruqi/Telegram-iOS',	'utf-8'),
(257,	'可以在这里找到一些公开的网络账号。可用于个人的隐私保护。原由：http://liruqi.info/post/59185719696/publish-my-skype-account\n\n各位有不用的账号，欢迎删除其中个人信息，共享出来。其中，http://justdelete.me/ 里不可删除的账号建议优先共享。\n\n[[Category:个人隐私保护]]',	'utf-8'),
(258,	'大家好，我是李如其。RoomChat 站长。因为这是我的网站，root 这个用户名又比较牛逼，我就叫 root 好了。\n\n首字母自动大写很讨厌，我有时间再把这规矩给改了。\n\n* 邮箱：admin@roomchat.im\n* 更多关于我：https://about.me/liruqi\n\n== 文章 ==\n* [[User:Root/北京房价]]\n* [[User:Root/Telegram]]',	'utf-8'),
(259,	'Telegram 的 [https://en.wikipedia.org/wiki/Telegram_(software) Wikipedia词条]。\n\nTelegram 是一个基于手机通讯录的即时通信软件，用起来跟 WhatApp，Messanger 或者微信，没有本质区别。其[https://telegram.org/ 官网]的一句话介绍是：Telegram is a cloud-based mobile and desktop messaging app with a focus on security and speed。但有一个很大的区别在于其平台的开放性。Telegram 开源了所有客户端代码，包括 iOS、Android、Windows Phone 以及 PC 的 Mac OS X，Windows 和 Web。开发者可以在 Telegram 上创建应用，做UI和功能定制的客户端，在第三方客户端登陆之后，可以直接跟现有的 Telegram 用户通讯。\n\nTelegram 的用户身份认证也是创造性的极简。注册、登录只需要填写手机号，然后给你手机上发短信验证码，输入验证码即可完成验证步骤。\n\n== iOS ==\n目前（2015年6月26日）Telegram 的 iOS 代码看起来是2015年1月的打包。编译之后有明显的UI渲染的问题，我做了简单的修复：https://github.com/liruqi/Telegram-iOS\n\n* TGCreateEncryptedChatController 创建 Secret Chat。第一步，创建 actor：\n    static int actionId = 0;\n    [ActionStageInstance() requestActor:[[NSString alloc] initWithFormat:@\"/tg/encrypted/createChat/(profile%d)\", actionId++] options:@{@\"uid\": @(user.uid)} flags:0 watcher:self];\n\n第二步，在主线程展示 Secret Chat View Controller：\n    TGConversation *conversation = result[@\"conversation\"];\n    [[TGInterfaceManager instance] navigateToConversationWithId:conversation.conversationId conversation:nil];',	'utf-8'),
