(263,	'[https://developer.apple.com/testflight/ TestFlight]\n\n使用的时候注意几个地方：\n* 加 External Testers 需要人工审核。一个 Apple ID 加入 External Testers 之后，就无法邀请到 Internal Testers，但网站上没有任何提示，被邀请者也收不到邀请邮件。\n* 加 Internal Testers 不需要人工审核，只要你填写完成应用信息，有可以提交 binary 即可，但是添加 Internal Testers 是在 Users and Roles 模块，添加的时候需要给 Admin 权限才会在 Internal Testers 列表中出现。\n\n[[Category:软件开发/iOS]]',	'utf-8'),
(264,	'[https://developer.apple.com/testflight/ TestFlight]\n\n使用的时候注意几个地方：\n\n* 加 Internal Testers 不需要人工审核，只要你填写完成应用信息，有可以提交 binary 即可，但是添加 Internal Testers 是在 Users and Roles 模块，添加的时候需要给 Admin 权限才会在 Internal Testers 列表中出现。\n* 上 External Test 需要人工审核。一个 Apple ID 加入 External Testers 之后，就无法邀请到 Internal Testers，但网站上没有任何提示，被邀请者也收不到邀请邮件。\n\n[[Category:软件开发/iOS]]',	'utf-8'),
(265,	'[https://developer.apple.com/testflight/ TestFlight]\n\n== 入门 ==\n* [http://www.raywenderlich.com/101790/ios-beta-testing-with-testflight-tutorial iOS Beta Testing with TestFlight Tutorial]\n\n== 使用 ==\n使用的时候注意几个地方：\n\n* 加 Internal Testers 不需要人工审核，只要你填写完成应用信息，有可以提交 binary 即可，但是添加 Internal Testers 是在 Users and Roles 模块，添加的时候需要给 Admin 权限才会在 Internal Testers 列表中出现。\n* 上 External Test 需要人工审核。一个 Apple ID 加入 External Testers 之后，就无法邀请到 Internal Testers，但网站上没有任何提示，被邀请者也收不到邀请邮件。\n\n[[Category:软件开发/iOS]]',	'utf-8'),
(266,	'\n== 使用 ==\n\n=== submodule ===\n\n* Add submodule to path: <code>git submodule add https://github.com/facebook/pop Telegraph/thirdparty/pop</code>',	'utf-8'),
(267,	'\n== 使用 ==\n\n=== submodule ===\n\n* Add submodule to path: <code>git submodule add https://github.com/facebook/pop Telegraph/thirdparty/pop</code>\n* `git clone` including submodules <code>git clone --recursive https://github.com/liruqi/Telegram-iOS</code>\n\nCategory:开源软件',	'utf-8'),
(268,	'\n== 使用 ==\n\n=== submodule ===\n\n* Add submodule to path: <code>git submodule add https://github.com/facebook/pop Telegraph/thirdparty/pop</code>\n* `git clone` including submodules <code>git clone --recursive https://github.com/liruqi/Telegram-iOS</code>\n\n[[Category:开源软件]]',	'utf-8'),
(269,	'\n== 使用 ==\n\n=== submodule ===\n\n* Add submodule to path: <code>git submodule add https://github.com/facebook/pop Telegraph/thirdparty/pop</code>\n* `git clone` including submodules: <code>git clone --recursive https://github.com/liruqi/Telegram-iOS</code> \n* Checkout all submodules for existing repo: <code> git submodule update --init --recursive </code> \n\n参考 \n* [http://stackoverflow.com/questions/3796927/how-to-git-clone-including-submodules How to `git clone` including submodules?]\n\n[[Category:开源软件]]',	'utf-8'),
(270,	'== iOS Dev Center ==\nhttps://developer.apple.com/devcenter/ios/index.action\n\n== 教程 ==\n* http://objc.io/\n* http://www.raywenderlich.com/\n\n== 证书 ==\n* 创建 APNS 推送证书 [http://www.raywenderlich.com/32960/apple-push-notification-services-in-ios-6-tutorial-part-1 Apple Push Notification Services in iOS 6 Tutorial: Part 1/2]\n\n== SDK ==\n\n=== iOS7 ===\niOS 对状态栏 (Status Bar)、导航栏(Navigation Bar) 做了很大的改造，设计美感提升很多，给开发者带来的问题也很多。\n\n* iOS7 下修改状态栏颜色 [http://stackoverflow.com/questions/17678881/how-to-change-status-bar-text-color-in-ios-7 How to change Status Bar text color in iOS 7]\n* <code>- preferredStatusBarStyle</code> 无法修改状态栏颜色，其中存在 UINavigationController 的时候需要单独处理 [http://stackoverflow.com/questions/19022210/preferredstatusbarstyle-isnt-called preferredStatusBarStyle isn\'t called]\n* 导航栏颜色失真、泛白，设置 Navigation Bar 的 translucent 属性为 NO。translucent 属性带来的色值转换：[http://stackoverflow.com/questions/18895252/get-the-right-color-in-ios7-translucent-navigation-bar Get the right color in iOS7 translucent navigation bar]\n\n=== UITabBarController ===\n\n<code>UITabBarController</code> 自带了 <code>UITabBar</code> 视图。使用的时候，不应该直接管理 <code>UITabBar</code> 的 items。而应该用 <code>UITabBarController</code> 提供的  <code>-  (void)setViewControllers</code> 系列方法。\n\n== iOS开发博客 ==\n* [http://www.devtang.com/ 唐巧的技术博客]\n* [http://blog.sunnyxx.com/ sunnyxx的技术博客]\n\n[[Category:软件开发]]',	'utf-8'),
