id Architectures 添加 arm64, armv7, armv7s, i386\n\n另外，Telegram 中用到 libcrypto.a 和 libopus.a 都需要重新编译，增加 arm64 架构。否则生成的 MTProtoKit framework 没有 arm64 架构支持，导致 Build Telegram 时链接失败。\n\n=== 源码解析 ===\n* TGCreateEncryptedChatController 创建 Secret Chat。第一步，创建 actor：\n    static int actionId = 0;\n    [ActionStageInstance() requestActor:[[NSString alloc] initWithFormat:@\"/tg/encrypted/createChat/(profile%d)\", actionId++] options:@{@\"uid\": @(user.uid)} flags:0 watcher:self];\n\n第二步，在主线程展示 Secret Chat View Controller：\n    TGConversation *conversation = result[@\"conversation\"];\n    [[TGInterfaceManager instance] navigateToConversationWithId:conversation.conversationId conversation:nil];',	'utf-8'),
(284,	'\n== 使用 ==\n\n=== submodule ===\n\n* Add submodule to path: <code>git submodule add https://github.com/facebook/pop Telegraph/thirdparty/pop</code>\n* `git clone` including submodules: <code>git clone --recursive https://github.com/liruqi/Telegram-iOS</code> \n* Checkout all submodules for existing repo: <code> git submodule update --init --recursive </code> \n* 彻底删除一个 submodule ：<code>git submodule deinit && rm -rfv .git/modules/*</code>\n\n参考 \n* [http://stackoverflow.com/questions/3796927/how-to-git-clone-including-submodules How to `git clone` including submodules?]\n\n[[Category:开源软件]]',	'utf-8'),
(285,	'\n== 使用 ==\n\n=== submodule ===\n\n* Add submodule to path: <code>git submodule add https://github.com/facebook/pop Telegraph/thirdparty/pop</code>\n* `git clone` including submodules: <code>git clone --recursive https://github.com/liruqi/Telegram-iOS</code> \n* Checkout all submodules for existing repo: <code> git submodule update --init --recursive </code> \n* 彻底删除一个 submodule ：<code>git submodule deinit && rm -rfv .git/modules/*</code>\n* 更新 submodule 版本到 HEAD：<code>git submodule foreach git pull origin master</code>，如果 HEAD 版本测试没有问题，再 git 提交 submodule 变更，即可生效。\n\n参考 \n* [http://stackoverflow.com/questions/3796927/how-to-git-clone-including-submodules How to `git clone` including submodules?]\n\n[[Category:开源软件]]',	'utf-8'),
(286,	'== iOS Dev Center ==\nhttps://developer.apple.com/devcenter/ios/index.action\n\n== 教程 ==\n* http://objc.io/\n* http://www.raywenderlich.com/\n\n== 证书 ==\n* 创建 APNS 推送证书 [http://www.raywenderlich.com/32960/apple-push-notification-services-in-ios-6-tutorial-part-1 Apple Push Notification Services in iOS 6 Tutorial: Part 1/2]\n\n== SDK ==\n\n=== iOS7 ===\niOS 对状态栏 (Status Bar)、导航栏(Navigation Bar) 做了很大的改造，设计美感提升很多，给开发者带来的问题也很多。\n\n* iOS7 下修改状态栏颜色 [http://stackoverflow.com/questions/17678881/how-to-change-status-bar-text-color-in-ios-7 How to change Status Bar text color in iOS 7]\n* <code>- preferredStatusBarStyle</code> 无法修改状态栏颜色，其中存在 UINavigationController 的时候需要单独处理 [http://stackoverflow.com/questions/19022210/preferredstatusbarstyle-isnt-called preferredStatusBarStyle isn\'t called]\n* 导航栏颜色失真、泛白，设置 Navigation Bar 的 translucent 属性为 NO。translucent 属性带来的色值转换：[http://stackoverflow.com/questions/18895252/get-the-right-color-in-ios7-translucent-navigation-bar Get the right color in iOS7 translucent navigation bar]\n\n=== UITabBarController ===\n\n<code>UITabBarController</code> 自带了 <code>UITabBar</code> 视图。使用的时候，不应该直接管理 <code>UITabBar</code> 的 items。而应该用 <code>UITabBarController</code> 提供的  <code>-  (void)setViewControllers</code> 系列方法。\n\n\n== 崩溃统计 ==\n常用的有下面几个：\n* Crashlytics\n* Crittercism\n* Bugsense\n* HockeyApp\n\n具体分析和使用参考 Overview of iOS Crash Reporting Tools [http://www.raywenderlich.com/33669/overview-of-ios-crash-reporting-tools-part-1 Part 1/2], [http://www.raywenderlich.com/34050/overview-of-ios-crash-reporting-tools-part-2 Part 2/2] (2013年5月)\n\n== iOS开发博客 ==\n* [http://www.devtang.com/ 唐巧的技术博客]\n* [http://blog.sunnyxx.com/ sunnyxx的技术博客]\n\n[[Category:软件开发]]',	'utf-8'),
(287,	'== iOS Dev Center ==\nhttps://developer.apple.com/devcenter/ios/index.action\n\n== 教程 ==\n* http://objc.io/\n* http://www.raywenderlich.com/\n\n== 证书 ==\n* 创建 APNS 推送证书 [http://www.raywenderlich.com/32960/apple-push-notification-services-in-ios-6-tutorial-part-1 Apple Push Notification Services in iOS 6 Tutorial: Part 1/2]\n\n== SDK ==\n\n=== iOS7 ===\niOS 对状态栏 (Status Bar)、导航栏(Navigation Bar) 做了很大的改造，设计美感提升很多，给开发者带来的问题也很多。\n\n* iOS7 下修改状态栏颜色 [http://stackoverflow.com/questions/17678881/how-to-change-status-bar-text-color-in-ios-7 How to change Status Bar text color in iOS 7]\n* <code>- preferredStatusBarStyle</code> 无法修改状态栏颜色，其中存在 UINavigationController 的时候需要单独处理 [http://stackoverflow.com/questions/19022210/preferredstatusbarstyle-isnt-called preferredStatusBarStyle isn\'t called]\n* 导航栏颜色失真、泛白，设置 Navigation Bar 的 translucent 属性为 NO。translucent 属性带来的色值转换：[http://stackoverflow.com/questions/18895252/get-the-right-color-in-ios7-translucent-navigation-bar Get the right color in iOS7 translucent navigation bar]\n\n=== UITabBarController ===\n\n<code>UITabBarController</code> 自带了 <code>UITabBar</code> 视图。使用的时候，不应该直接管理 <code>UITabBar</code> 的 items。而应该用 <code>UITabBarController</code> 提供的  <code>-  (void)setViewControllers</code> 系列方法。\n\n\n== 崩溃统计 ==\n常用的有下面几个：\n* Crashlytics\n* Crittercism\n* Bugsense\n* HockeyApp\n\n具体分析和使用参考 Overview of iOS Crash Reporting Tools: [http://www.raywenderlich.com/33669/overview-of-ios-crash-reporting-tools-part-1 Part 1/2], [http://www.raywenderlich.com/34050/overview-of-ios-crash-reporting-tools-part-2 Part 2/2] (2013年5月，其中介绍了TestFlight，但被苹果收购之后，TestFlight 崩溃统计功能被阉割)\n\n== iOS开发博客 ==\n* [http://www.devtang.com/ 唐巧的技术博客]\n* [http://blog.sunnyxx.com/ sunnyxx的技术博客]\n\n[[Category:软件开发]]',	'utf-8'),
(288,	'== 加载自定义 <code>UITableViewCell</code> ==\n<code>\n- (UITableViewCell *)tableView:(UITableView *)tableView cellForRowAtIndexPath:(NSIndexPath *)indexPath {\n    UITableViewCell *cell = [tableView dequeueReusableCellWithIdentifier:@\"BDCustomCell\"];\n    if (cell == nil) {\n        // Load the top-level objects from the custom cell XIB.\n        NSArray *topLevelObjects = [[NSBundle mainBundle] loadNibNamed:@\"BDCustomCell\" owner:self options:nil];\n        // Grab a pointer to the first object (presumably the custom cell, as that\'s all the XIB should contain).\n        cell = [topLevelObjects firstObject];\n    }\n\n    return cell;\n}\n</code>\n参考 [http://stackoverflow.com/questions/540345/ How do you load custom UITableViewCells from Xib files?]',	'utf-8'),
(289,	'== 加载自定义 <code>UITableViewCell</code> ==\n<code>- (UITableViewCell *)tableView:(UITableView *)tableView cellForRowAtIndexPath:(NSIndexPath *)indexPath {\n    UITableViewCell *cell = [tableView dequeueReusableCellWithIdentifier:@\"BDCustomCell\"];\n    if (cell == nil) {\n        // Load the top-level objects from the custom cell XIB.\n        NSArray *topLevelObjects = [[NSBundle mainBundle] loadNibNamed:@\"BDCustomCell\" owner:self options:nil];\n        // Grab a pointer to the first object (presumably the custom cell, as that\'s all the XIB should contain).\n        cell = [topLevelObjects firstObject];\n    }\n    return cell;\n}</code>\n\n参考 [http://stackoverflow.com/questions/540345/ How do you load custom UITableViewCells from Xib files?]',	'utf-8'),
(290,	'== 加载自定义 <code>UITableViewCell</code> ==\n\n    - (UITableViewCell *)tableView:(UITableView *)tableView cellForRowAtIndexPath:(NSIndexPath *)indexPath {\n        UITableViewCell *cell = [tableView dequeueReusableCellWithIdentifier:@\"BDCustomCell\"];\n        if (cell == nil) {\n            NSArray *topLevelObjects = [[NSBundle mainBundle] loadNibNamed:@\"BDCustomCell\" owner:self options:nil];\n            cell = [topLevelObjects firstObject];\n        }\n        return cell;\n    }\n\n参考 [http://stackoverflow.com/questions/540345/ How do you load custom UITableViewCells from Xib files?]',	'utf-8'),
(291,	'== 加载自定义 <code>UITableViewCell</code> ==\n\n    - (UITableViewCell *)tableView:(UITableView *)tableView cellForRowAtIndexPath:(NSIndexPath *)indexPath {\n        UITableViewCell *cell = [tableView dequeueReusableCellWithIdentifier:@\"BDCustomCell\"];\n        if (cell == nil) {\n            NSArray *topLevelObjects = [[NSBundle mainBundle] loadNibNamed:@\"BDCustomCell\" owner:self options:nil];\n            cell = [topLevelObjects firstObject];\n        }\n        return cell;\n    }\n\n参考 \n* [http://bdunagan.com/2009/06/28/custom-uitableviewcell-from-a-xib-in-interface-builder/ Custom UITableViewCell from a XIB in Interface Builder]\n* [http://stackoverflow.com/questions/540345/ How do you load custom UITableViewCells from Xib files?]',	'utf-8'),
(292,	'== 加载自定义 <code>UITableViewCell</code> ==\n\n    - (UITableViewCell *)tableView:(UITableView *)tableView cellForRowAtIndexPath:(NSIndexPath *)indexPath {\n        UITableViewCell *cell = [tableView dequeueReusableCellWithIdentifier:@\"BDCustomCell\"];\n        if (cell == nil) {\n            NSArray *topLevelObjects = [[NSBundle mainBundle] loadNibNamed:@\"BDCustomCell\" owner:self options:nil];\n            cell = [topLevelObjects firstObject];\n        }\n        return cell;\n    }\n\n参考 \n* [http://bdunagan.com/2009/06/28/custom-uitableviewcell-from-a-xib-in-interface-builder/ Custom UITableViewCell from a XIB in Interface Builder]\n* [http://stackoverflow.com/questions/540345/ How do you load custom UITableViewCells from Xib files?]\n\n运行时错误处理\n* [http://stackoverflow.com/questions/12737860/ Assertion failure in dequeueReusableCellWithIdentifier:forIndexPath:]\n* [http://stackoverflow.com/questions/11985487/ Custom UITableViewCell gives me: this class is not key value coding-compliant]',	'utf-8'),
(293,	'== 加载自定义 <code>UITableViewCell</code> ==\n\n    - (UITableViewCell *)tableView:(UITableView *)tableView cellForRowAtIndexPath:(NSIndexPath *)indexPath {\n        UITableViewCell *cell = [tableView dequeueReusableCellWithIdentifier:@\"BDCustomCell\"];\n        if (cell == nil) {\n            NSArray *topLevelObjects = [[NSBundle mainBundle] loadNibNamed:@\"BDCustomCell\" owner:self options:nil];\n            cell = [topLevelObjects firstObject];\n        }\n        return cell;\n    }\n\n参考 \n* [http://bdunagan.com/2009/06/28/custom-uitableviewcell-from-a-xib-in-interface-builder/ Custom UITableViewCell from a XIB in Interface Builder]\n* [http://stackoverflow.com/questions/540345/ How do you load custom UITableViewCells from Xib files?]\n\n运行时错误处理\n* [http://stackoverflow.com/questions/12737860/ Assertion failure in dequeueReusableCellWithIdentifier:forIndexPath:]\n* [http://stackoverflow.com/questions/11985487/ Custom UITableViewCell gives me: this class is not key value coding-compliant]\n\n[[Category:软件开发/iOS]]',	'utf-8'),
