(301,	'[Git https://git-scm.com/]\n\n== 使用 ==\n=== merge ===\n* 同步上游 Repo 的变更: [Merging an upstream repository into your fork https://help.github.com/articles/merging-an-upstream-repository-into-your-fork/]\n\n=== submodule ===\n\n* Add submodule to path: <code>git submodule add https://github.com/facebook/pop Telegraph/thirdparty/pop</code>\n* `git clone` including submodules: <code>git clone --recursive https://github.com/liruqi/Telegram-iOS</code> \n* Checkout all submodules for existing repo: <code> git submodule update --init --recursive </code> \n* 彻底删除一个 submodule ：<code>git submodule deinit && rm -rfv .git/modules/*</code>\n* 更新 submodule 版本到 HEAD：<code>git submodule foreach git pull origin master</code>，如果 HEAD 版本测试没有问题，再 git 提交 submodule 变更，即可生效。\n\n参考 \n* [http://stackoverflow.com/questions/3796927/how-to-git-clone-including-submodules How to `git clone` including submodules?]\n\n\n[[Category:开源软件]]',	'utf-8'),
(302,	'[https://git-scm.com/ Git]\n\n== 使用 ==\n=== merge ===\n* 同步上游 Repo 的变更: [https://help.github.com/articles/merging-an-upstream-repository-into-your-fork/ Merging an upstream repository into your fork]\n\n=== submodule ===\n\n* Add submodule to path: <code>git submodule add https://github.com/facebook/pop Telegraph/thirdparty/pop</code>\n* `git clone` including submodules: <code>git clone --recursive https://github.com/liruqi/Telegram-iOS</code> \n* Checkout all submodules for existing repo: <code> git submodule update --init --recursive </code> \n* 彻底删除一个 submodule ：<code>git submodule deinit && rm -rfv .git/modules/*</code>\n* 更新 submodule 版本到 HEAD：<code>git submodule foreach git pull origin master</code>，如果 HEAD 版本测试没有问题，再 git 提交 submodule 变更，即可生效。\n\n参考 \n* [http://stackoverflow.com/questions/3796927/how-to-git-clone-including-submodules How to `git clone` including submodules?]\n\n\n[[Category:开源软件]]',	'utf-8'),
(303,	'系统基础库\n\nCategory/Util\n\n[sstoolkit][0]一套Category类型的库,附带很多自定义控件 功能不错～[BFKit][1]又一套Category类型的 Kit，还有几个工具类[APUtils][2]又一套Category类型的 Kit[QSKit][3]又一套Category类型的 Kit[iOS-Categories][4]又一套Category类型的 Kit[BlocksKit][5]将Block风格带入UIKit和Founcation[cocoa-helpers][6]一些Cocoa的扩展 2年前的工程[iOS-NBUKit][7]一套基础工具库[CoconutKit][8]一系列扩展和一些自定组件[STUtils][9]一系列扩展包[PSFoundation][10]一系列扩展 和功能增强[ConciseKit][11]一系列宏定义 挺有意思[DTFoundation][12]又一系列扩展。。。[BBBootstrap][13]一些常见功能的扩展库[Objective-Shorthand][14]将长方法简化的Category[BGUtilities][15]几个简单好用的Cagegory[cooliris-toolkit][16]cooliris出品的基础工具库,从GoogleCode clone过来[BaseKit][17]一套基础工具库[NSObject-Utility-Categories][18]如题[NSArray-Utilities][19]如题[aqtoolkit][20]一些常用的东西[DLIntrospection][21]一些NSObject的扩展[YOLOKit][22]一些方便的快速枚举方法[NSDate-Extensions][23]如题日期[ALActionBlocks][24]在UIControl上添加的Block事件[jrswizzle][25]主要是swizzling[moriarty][26]一些还算有用的功能[QSUtilities][27]一些基础库 (Instagram有用到)[libextobjc][28]一堆oc的扩展[PrettyTimestamp][29]友好时间的扩展[DateTools][30]不错的时间处理相关的工具箱[ios-jail-break-detector][31]检测是否越狱 有上线[crackify][32]检测App是否被破解[UIView-AnimatedProperty][33]为UIView添加动画效果的property,有用到swizzle[UIView-Positioning][34]为UIView的frame等添加更多属性，方便设置view[Block-KVO][35]Block风格的KVO~[MTDates][36]一些Data的category[CocoaSecurity][37]常见的哈希、加密解密算法[FCFileManager][38]更好更方便的访问文件和文件夹[sskeychain][39]访问keychain 支持iOS Mac[UISS][40]用JSON的风格设置UIKit样式[Underscore.m][41]仿JS的underscore.js来写的,用于访问和处理数据[TICoreDataSync][42]在不同设备间对CoreData进行同步 (iPhone iPad Mac)[SoloComponents-iOS][43]几个轻量的组件,没什么用,2年没更新[MAObjCRuntime][44]将运行时包装成ObjC[Objective-C-Generics][45]通过宏定义勉强实现的范型[TBMacros][46]一些常用的宏定义[NSString-Ruby][47]为Ruby程序员带来的字符串相关功能[ObjectiveRecord][48]CoreData包装的活动记录 有RoR风格的API\n\n基础功能\n\n[mediaextract][49]纯C的一些常用媒体文件的解析读取[objection][50]一个估计是java ee写多了的人搞的。。注解依赖注入xx工厂之类的[Typhoon][51]IoC容器啊～～[HTKit][52]一票乱七八糟的东西[StringScore][53]模糊匹配字符串 查找某两个字符串的相似程度[RegexKitLite][54]正则表达式库 (从SF.net mirror过来)[Objective-C-RegEx-Categories][55]正则表达[FormatterKit][56]一个NSString的格式化工具，支持时间、颜色、地址、名字等等[TransformerKit][57]NSValueTransformer的封装[NanoStore][58]KV存储 (无模式/NoSQL)[TMCache][59]tumblr开源的一个内存/文件缓存，很棒[PINCache][60]pinterest开元的的一个内存/文件缓存，从TMCache修改而来，快速无死锁[EGOCache][61]EGOImage里面的 Cache功能[Haneke][62]一个开箱即用的图片Cache[HJCache][63]一个缓存网络内容等的Cache[RNCryptor][64]加密解密相关 貌似更上流, note:去看一下他博客,有更详细的文章[MIHCrypto][65]各种加密解密算法 (AES/DES/RSA/MD5/SHA等)，包装自OpenSSL[ssziparchive][66]zip压缩 zip解压~[ZipKit][67]一个ZipKit 从bitbucket Mirror过来[ZipKit][68]如同ZipKit 改为ARC了[zipzap][69]Zip文件处理 底层为libz[MTMigration][70]版本升时执行一次[MTControl][71]jQuery风格touch事件绑定[storage][72]快速、线程安全的I/O存储操作[CHCSVParser][73]CVS文件解析[YLMoment][74]日期的解析，格式化等，支持多语言[CMUnistrokeGestureRecognizer][75]各种奇怪的手势检测[EKAlgorithms][76]常见算法的ObjC实现，包括排序、查找、数组、字符串、常用数据结构..\n\n框架/封装\n\n[three20][77]Facebook 的一个曾经用得广泛的庞大的iOS开发框架 陈旧并且已不再维护[nimbus][78]three20替代品 又一个庞大的框架[BeeFramework][79]一个基于MVC的框架, 比较大..[OmniGroup][80]一套很庞大的库(OmniGroup) 支持Mac和iOS[ReactiveCocoa][81]一套响应式编程的框架(Functional Reactive Programming) 支持Mac[componentkit][82]Facebook 的一个功能性的、响应式UI框架, 被应用于Facebook App[AsyncDisplayKit][83]Facebook 出的一个用于保持UI流畅性的框架, 其原理被用于Paper[react-native][84]Facebook 出的框架, 通过JS和React构建原生界面[KVOController][85]Facebook 出的线程安全KVO[MAKVONotificationCenter][86]一个自定义KVO Center[WebViewJavascriptBridge][87]UIWebView和Cocoa之间的事件传递[JavaScriptBridge][88]JavaScriptCore到Cocoa之间的变量传递和代码执行Bridge[OCUDL][89]自定义literals 有点意思～～[Motif][90]通过 JSON 定制界面，支持 Live Reload[Kiwi][91]BDD for iOS[MagicalRecord][92]CoreData的包装 简化代码[fmdb][93]SQLite的封装[KZPropertyMapper][94]一个Model的封装,类JSON[BlockInjection][95]为某个方法前后注入Block，类似AOP[Aspects][96]又一个AOP库，用swizzle实现的切面...[Bolts-iOS][97]低层次的，更好的管理异步任务的库，支持Facebook AppLinks(同时有Android版)[NSObject-ObjectMap][98]JSON和XML包装到Object[Ejecta][99]通过OpenGL OpenAL来实现 WebCanvas JS等,很庞大~[FCModel][100]为SQL程序员包装一下CoreData\n\n功能/封装\n\n[iOS-System-Services][101]获取各种设备信息 包括硬件、网络、内存、进程等等[iAppInfos][102]简单获取设备信息，例如设备、空间、Provisionning[LocationManager][103]更好用的获取和追踪设备位置的工具，包括GPS信息[MKStoreKit][104]iAP用的库[CargoBay][105]一个包装iAP StoreKit的库[RMStore][106]很轻量的iAP包装[OpenUDID][107]系统UDID替代方案[UIDevice-with-UniqueIdentifier-for-iOS-5][108]另一个UUID解决方案 但iOS7不能用了[uidevice-extension][109]一系列UIDevice的扩展 有PrivateAPI 最新的工程在cookbook-code里[InAppSettingsKit][110]包装了设置、URLScheme、Mail、Icon等东西[DTWebArchive][111]允许访问剪贴板中的WebArchive格式富文本[routable-ios][112]inApp的URL定义 在App内打开自定义URL (解耦)[JLRoutes][113]复杂的URL Scheme解析和路由[Emoji][114]访问Emoji图片的功能[PDKeychainBindingsController][115]以类似UserDefault的方式访问Keychain[CoreTextWrapper][116]一个CoreText库的包装[Slash][117]对AttributeString的封装[ABContactHelper][118]访问联系人[APAddressBook][119]封装了访问通信录/联系人的功能[GVUserDefaults][120]包装了 NSUserDefaults，只需要声明属性就能用，很方便[YapDatabase][121]一个KV库，包装自sqlite，但有更多包装好的功能，比如缓存/全文搜索[YTKKeyValueStore][122]又一个KV库，简单包装自sqlite(FMDB)[realm-cocoa][123]为移动设备专门设计的数据库，旨在替代sqlite/CoreData[iHasApp][124]检测某个App是否安装，集成了常见的URL Scheme[UIActivityCollection][125]Github上UIActivity项目的集合[STPTransitions][126]更好的 自定义ViewCtrl 过渡动画API[PureLayout][127]AutoLayout的封装，支持iOS/Mac，支持swift[Masonry][128]AutoLayout的封装[KeepLayout][129]AutoLayout的封装 貌似比较好用[JTSHardwareInfo][130]定义enum来获取和判断设备型号[MTGeometry][131]CGPoint/Size/Rect的一些几何学的计算[MYSRuntime][132]包装了RunTime的一些方法，使用更容易[MTStringAttributes][133]更容易的访问和修改 NSAttributedString[MTPDF][134]基于CF的PDF Object封装，更容易的访问和创建PDF\n\n[0]: https://github.com/soffes/sstoolkit\n[1]: https://github.com/FabrizioBrancati/BFKit\n[2]: https://github.com/andrei512/APUtils\n[3]: https://github.com/quartermaster/QSKit\n[4]: https://github.com/shaojiankui/iOS-Categories\n[5]: https://github.com/zwaldowski/BlocksKit\n[6]: https://github.com/enormego/cocoa-helpers\n[7]: https://github.com/CyberAgent/iOS-NBUKit\n[8]: https://github.com/defagos/CoconutKit\n[9]: https://github.com/ldandersen/STUtils\n[10]: https://github.com/steipete/PSFoundation\n[11]: https://github.com/petejkim/ConciseKit\n[12]: https://github.com/Cocoanetics/DTFoundation\n[13]: https://github.com/brunodecarvalho/BBBootstrap\n[14]: https://github.com/khanlou/Objective-Shorthand\n[15]: https://github.com/bennyguitar/BGUtilities\n[16]: https://github.com/mave99a/cooliris-toolki