(305,	'==数据备份==\n* 计划每天把数据库 dump 成文本格式提交到 github，这样可以方便用户用户关注内容变更。\n* 可以通过 github 提交 PR 来更新 wiki。\n\n==Social==\n* 每个词条展示创建者，贡献者\n* 用户可以关注此条，首页 timeline 显示被关注词条的变更\n* 大的词条类别，可以展示即时讨论的界面\n\n==编辑==\n* 词条修改不能即时生效，至少需要一位贡献者 approve 才可以。\n* 制作浏览器插件，可以把网页收藏、提交到某个分类。根据评分系统判断其链接在词条中展示的位置。\n\n==移动客户端==\n移动客户端分几个 Tab，\n* 生活\n* 工作\n* 读书\n* 历史\n* 电影\n* 音乐\n\n每个tab下做子分类。\n\n[[RoomChat/更新日志]]',	'utf-8'),
(306,	'Android, iOS, Web\n\n== 入门学习 ==\n\n* [http://www.jikexueyuan.com/?utm_source=roomchat.im 极客学院]',	'utf-8'),
(307,	'==数据备份==\n* 计划每天把数据库 dump 成文本格式提交到 github，这样可以方便用户用户关注内容变更。\n* 可以通过 github 提交 PR 来更新 wiki。\n\n==Social==\n* 每个词条展示创建者，贡献者\n* 用户可以关注此条，首页 timeline 显示被关注词条的变更\n* 大的词条类别，可以展示即时讨论的界面\n\n==编辑==\n* 词条修改不能即时生效，至少需要一位贡献者 approve 才可以。\n* 制作浏览器插件，可以把网页收藏、提交到某个分类。根据评分系统判断其链接在词条中展示的位置。\n* 权限管理：初级用户只能发链接，以及连接的描述；分类管理成员可以修改分类、title 的描述。\n\n==移动客户端==\n移动客户端分几个 Tab，\n* 生活\n* 工作\n* 读书\n* 历史\n* 电影\n* 音乐\n\n每个tab下做子分类。\n\n[[RoomChat/更新日志]]',	'utf-8'),
(308,	'== Ubuntu 14.04 ==\n\n=== 安装 libprotobuf9 & libprotoc9 2.6.1 ===\n  sudo add-apt-repository ppa:ubuntu-toolchain-r/test\n  sudo apt-get update\n  sudo apt-get install g++-4.9\n  wget https://launchpad.net/ubuntu/+archive/primary/+files/libprotoc9_2.6.1-1_amd64.deb\n  wget https://launchpad.net/ubuntu/+archive/primary/+files/libprotobuf9_2.6.1-1_amd64.deb\n  dpkg -i libprotobuf9_2.6.1-1_amd64.deb\n  dpkg -i libprotoc9_2.6.1-1_amd64.deb\n\n参考\n* [http://askubuntu.com/questions/428198/getting-installing-gcc-g-4-9-on-ubuntu Getting + installing gcc/g++ 4.9 on Ubuntu?]\n* [https://launchpad.net/ubuntu/+source/protobuf protobuf package in Ubuntu]',	'utf-8'),
(309,	'== Ubuntu 14.04 ==\n\n=== 安装 libprotobuf9 & libprotoc9 2.6.1 ===\n  sudo add-apt-repository ppa:ubuntu-toolchain-r/test\n  sudo apt-get update\n  sudo apt-get install g++-4.9\n  wget https://launchpad.net/ubuntu/+archive/primary/+files/libprotoc9_2.6.1-1_amd64.deb\n  wget https://launchpad.net/ubuntu/+archive/primary/+files/libprotobuf9_2.6.1-1_amd64.deb\n  dpkg -i libprotobuf9_2.6.1-1_amd64.deb\n  dpkg -i libprotoc9_2.6.1-1_amd64.deb\n\n参考\n* [http://askubuntu.com/questions/428198/getting-installing-gcc-g-4-9-on-ubuntu Getting + installing gcc/g++ 4.9 on Ubuntu?]\n* [https://launchpad.net/ubuntu/+source/protobuf protobuf package in Ubuntu]\n\n[[Category:操作系统]]',	'utf-8'),
(310,	'== Ubuntu 14.04 ==\n\n=== 安装 libprotobuf9 & libprotoc9 2.6.1 ===\n  sudo add-apt-repository ppa:ubuntu-toolchain-r/test\n  sudo apt-get update\n  sudo apt-get install g++-4.9\n  wget https://launchpad.net/ubuntu/+archive/primary/+files/libprotoc9_2.6.1-1_amd64.deb\n  wget https://launchpad.net/ubuntu/+archive/primary/+files/libprotobuf9_2.6.1-1_amd64.deb\n  wget https://launchpad.net/ubuntu/+archive/primary/+files/protobuf-compiler_2.6.1-1_amd64.deb\n  dpkg -i libprotobuf9_2.6.1-1_amd64.deb\n  dpkg -i libprotoc9_2.6.1-1_amd64.deb\n  dpkg -i protobuf-compiler_2.6.1-1_amd64.deb\n  \n参考\n* [http://askubuntu.com/questions/428198/getting-installing-gcc-g-4-9-on-ubuntu Getting + installing gcc/g++ 4.9 on Ubuntu?]\n* [https://launchpad.net/ubuntu/+source/protobuf protobuf package in Ubuntu]\n\n[[Category:操作系统]]',	'utf-8'),
(311,	'== Actor ==\n[http://actor.im/ Actor] 是由 Telegram 部分开发人员创建。\n\n== Actor Server ==\n\n=== Mac 编译 ===\n* 安装 Java 8: http://download.oracle.com/otn-pub/java/jdk/8u51-b16/jdk-8u51-macosx-x64.dmg\n* brew install protobuf-c\n* cd actor-server && ./sbt dist\n\n== Ubuntu 部署 ==\n* 安装、配置 PostgreSQL，创建一个 md5 验证的用户: \n<code>apt-get install postgresql postgresql-contrib</code>\n* 参考 config 目录下的模版，创建 <code>config/application.conf</code> 配置文件\n\n=== 错误处理 ===\n* org.postgresql.util.PSQLException: ERROR: could not open extension control file \"/usr/share/postgresql/9.3/extension/ltree.control\": No such file or directory\n\n<code>apt-get install postgresql-contrib</code>\nAnd run SQL command:\n<code> CREATE EXTENSION ltree;</code>',	'utf-8'),
(312,	'== Actor ==\n[http://actor.im/ Actor] 是由 Telegram 部分开发人员创建。\n\n== Actor Server ==\n\n=== Mac 编译 ===\n* 安装 Java 8: http://download.oracle.com/otn-pub/java/jdk/8u51-b16/jdk-8u51-macosx-x64.dmg\n* brew install protobuf-c\n* cd actor-server && ./sbt dist\n\n== Ubuntu 部署 ==\n* 安装、配置 PostgreSQL，创建一个 md5 验证的用户: \n<code>apt-get install postgresql postgresql-contrib</code>\n* 参考 config 目录下的模版，创建 <code>config/application.conf</code> 配置文件\n\n=== 错误处理 ===\n* org.postgresql.util.PSQLException: ERROR: could not open extension control file \"/usr/share/postgresql/9.3/extension/ltree.control\": No such file or directory\n\n<code>apt-get install postgresql-contrib</code>\n\nThen run SQL command:\n<code> CREATE EXTENSION ltree;</code>',	'utf-8'),
(313,	'== Actor ==\n[http://actor.im/ Actor] 是由 Telegram 部分开发人员创建。\n\n== Actor Server ==\n\n=== Mac 编译 ===\n* 安装 Java 8: http://download.oracle.com/otn-pub/java/jdk/8u51-b16/jdk-8u51-macosx-x64.dmg\n* brew install protobuf-c\n* cd actor-server && ./sbt dist\n\n== Ubuntu 部署 ==\n* 安装、配置 PostgreSQL，创建一个 md5 验证的用户: \n<code>createuser actor</code>\n* 参考 config 目录下的模版，创建 <code>config/application.conf</code> 配置文件\n\n=== 错误处理 ===\n* org.postgresql.util.PSQLException: ERROR: could not open extension control file \"/usr/share/postgresql/9.3/extension/ltree.control\": No such file or directory\n\n<code>apt-get install postgresql-contrib</code>\n\nThen run SQL command:\n<code> CREATE EXTENSION ltree;</code>',	'utf-8'),
(314,	'A Drawable is a general abstraction for \"something that can be drawn.\": [http://developer.android.com/reference/android/graphics/drawable/Drawable.html Drawable]\n\n== 使用 ==\n* 通过资源文件（.xml / .png）创建 Drawable 对象：<code>Context.getResources().getDrawable(android.R.drawable.progress_horizontal)</code> 参考：[http://developer.android.com/reference/android/content/res/Resources.html#getDrawable(int) getDrawable(int)]',	'utf-8'),
