(324,	'Android 单例对象往往需要传递<code>Context</code>对象，所以先在 Application 对象创建一个实例引用：\n\n    public class App extends Application {\n       private static App instance;\n       public static App get() { return instance; }\n    \n       @Override\n       public void onCreate() {\n          super.onCreate();\n          instance = this;\n       }\n    }\n\n然后用 enum 创建单例对象：\n\n    public enum Tools {\n        INSTANCE;\n        private Context context = App.getInstance();\n        public void printFavorites() {\n            System.out.println(Arrays.toString(favoriteSongs));\n        }\n    }\n\n* [http://stackoverflow.com/questions/14057273/ Android Singleton with Global Context]\n* [http://stackoverflow.com/questions/70689/ What is an efficient way to implement a singleton pattern in Java?]\n\n[[Category:软件开发/Android]]',	'utf-8'),
(325,	'[https://en.wikipedia.org/wiki/Proxy_auto-config Proxy_auto-config]\n\n== Mac ==\n系统设置 -&gt; 网络 -&gt; 高级 -&gt; 代理 -&gt; 自动代理配置 -&gt; URL中填入PAC地址 -&gt; 好\n\n== Windows ==\nInternet选项 -&gt; 连接 选项卡 -&gt; 局域网设置(如果是电脑拨号上网, 这里点\'设置\') -&gt; 使用自动配置脚本 -&gt; 填入PAC地址 -&gt; 确定',	'utf-8'),
(326,	'Android 单例对象往往需要传递<code>Context</code>对象，所以先在 Application 对象创建一个实例引用：\n\n    public class App extends Application {\n       private static App instance;\n       public static App get() { return instance; }\n    \n       @Override\n       public void onCreate() {\n          super.onCreate();\n          instance = this;\n       }\n    }\n\n然后用 enum 创建单例对象：\n\n    public enum Tools {\n        INSTANCE;\n        private Context context = App.getInstance();\n        public void drawableFromID(int id) {\n            return context.getResources().getDrawable(id);\n        }\n    }\n\n* [http://stackoverflow.com/questions/14057273/ Android Singleton with Global Context]\n* [http://stackoverflow.com/questions/70689/ What is an efficient way to implement a singleton pattern in Java?]\n\n[[Category:软件开发/Android]]',	'utf-8'),
(327,	'Android 单例对象往往需要传递<code>Context</code>对象，所以先在 Application 对象创建一个实例引用：\n\n    public class App extends Application {\n       private static App instance;\n       public static App get() { return instance; }\n    \n       @Override\n       public void onCreate() {\n          super.onCreate();\n          instance = this;\n       }\n    }\n\n然后用 enum 创建单例对象：\n\n    public enum SingleUtil {\n        INSTANCE;\n        private Context context = App.getInstance();\n        public Drawable drawableFromID(int id) {\n            return context.getResources().getDrawable(id);\n        }\n    }\n\n使用：\n\n    Drawable drawable = SingleUtil.INSTANCE.drawableFromID(android.R.drawable.ic_media_play);\n\n* [http://stackoverflow.com/questions/14057273/ Android Singleton with Global Context]\n* [http://stackoverflow.com/questions/70689/ What is an efficient way to implement a singleton pattern in Java?]\n\n[[Category:软件开发/Android]]',	'utf-8'),
