(329,	'Telegram 的 [https://en.wikipedia.org/wiki/Telegram_(software) Wikipedia词条]。\n\nTelegram 是一个基于手机通讯录的即时通信软件，用起来跟 WhatApp，Messanger 或者微信，没有本质区别。其[https://telegram.org/ 官网]的一句话介绍是：Telegram is a cloud-based mobile and desktop messaging app with a focus on security and speed。但有一个很大的区别在于其平台的开放性。Telegram 开源了所有客户端代码，包括 iOS、Android、Windows Phone 以及 PC 的 Mac OS X，Windows 和 Web。开发者可以在 Telegram 上创建应用，做UI和功能定制的客户端，在第三方客户端登陆之后，可以直接跟现有的 Telegram 用户通讯。\n\nTelegram 的用户身份认证也是创造性的极简。注册、登录只需要填写手机号，然后给你手机上发短信验证码，输入验证码即可完成验证步骤。\n\n== iOS ==\n目前（2015年6月26日）Telegram 的 iOS 代码是2015年1月的打的 zip 包。编译之后有明显的问题，我维护了一个修复版本：https://github.com/liruqi/Telegram-iOS\n\n=== 修复工程配置 ===\n[[File:IOS-Support-Matrix.png |100%|thumb|right|iOS设备和系统组成的架构支持矩阵]]\n\nTelegram 官方提供的 iOS 代码里，包含很多配置问题，比如引用了带 /Users/xxx 的绝对路径，以及开发者的个人苹果账号和证书。包括代码报的编译错误，这些明显的问题修复之后，有奇怪的编译问题：[http://stackoverflow.com/questions/28370297 source code of Telegram iOS app could\'not run on Xcode]\n\n里面有一个答案是安装 <code>https://github.com/kstenerud/iOS-Universal-Framework</code> 里面的 \"Real Framework\"。但是安装之后也会有各种问题，于是回过头来看一下这个 <code>iOS-Universal-Framework</code>究竟是干嘛的。项目的 ReadMe.md 前面有两句话：\n\n<code>With Xcode 6, Apple has added iOS framework support to their build tools, so this repo can at last be retired!</code>\n\n<code>Please use Apple\'s framework target for all new projects, as it is less hacky and is supported by Apple themselves. </code>\n\n这个 <code>iOS-Universal-Framework</code>，其实是一个给 Xcode Framework/Library 工程提供的打包脚本，放在 Build Phases 的 Run Script 里，以支持不同的架构。 \n\n在 Xcode 6 发布之前，需要用 <code>lipo</code> 给每个架构单独打包，然后合并。而 Xcode 6 之后，只需要在工程配置里把参数调整好，剩下的事情 Xcode 自动帮你搞定。\n\n所以解决方案很简单，删除 Run Script，然后设置好 Xcode 编译配置即可，如下图：\n\n[[File:Telegram-iOS-MTProtoKit-Xcode-Configuration.jpg |upright=3|frameless|center|baseline| Telegram iOS MTProtoKit Xcode Configuration]]\n\n其中：\n* Architectures 选择默认的 <code>$(ARCH_STANDARD)</code>\n* Build Active Architectures Only 一般 Debug 为 Yes，Release 为 No。如果 Debug 为 No，编译到设备上调试会巨慢；如果 Relase 为 Yes，打出的包很可能会出问题。\n* Valid Architectures 添加 arm64, armv7, armv7s, i386\n\n另外，Telegram 中用到 libcrypto.a 和 libopus.a 都需要重新编译，增加 arm64 架构。否则生成的 MTProtoKit framework 没有 arm64 架构支持，导致 Build Telegram 时链接失败。\n\n=== 源码解析 ===\n* TGCreateEncryptedChatController 创建 Secret Chat。第一步，创建 actor：\n    static int actionId = 0;\n    [ActionStageInstance() requestActor:[[NSString alloc] initWithFormat:@\"/tg/encrypted/createChat/(profile%d)\", actionId++] options:@{@\"uid\": @(user.uid)} flags:0 watcher:self];\n\n第二步，在主线程展示 Secret Chat View Controller：\n    TGConversation *conversation = result[@\"conversation\"];\n    [[TGInterfaceManager instance] navigateToConversationWithId:conversation.conversationId conversation:nil];\n\n=== 中文版下载 ===\n\n官方发布的版本没有汉化，自己做了一个中文版打包：http://pre.im/telegram\n\n[[Category:开源软件/Telegram]]',	'utf-8'),
