(331,	'[https://git-scm.com/ Git]\n\n== 使用 ==\n=== merge ===\n* 同步上游 Repo 的变更: [https://help.github.com/articles/merging-an-upstream-repository-into-your-fork/ Merging an upstream repository into your fork]\n\n=== submodule ===\n\n* Add submodule to path: <code>git submodule add https://github.com/facebook/pop Telegraph/thirdparty/pop</code>\n* `git clone` including submodules: <code>git clone --recursive https://github.com/liruqi/Telegram-iOS</code> \n* Checkout all submodules for existing repo: <code> git submodule update --init --recursive </code> \n* 彻底删除一个 submodule ：<code>git submodule deinit && rm -rfv .git/modules/*</code>\n* 更新 submodule 版本到 HEAD：<code>git submodule foreach git pull origin master</code>，如果 HEAD 版本测试没有问题，再 git 提交 submodule 变更，即可生效。\n\n=== branch ===\n* Manage branches on GitHub: [https://github.com/blog/1377-create-and-delete-branches Create and delete branches]\n\n参考 \n* [http://stackoverflow.com/questions/3796927/how-to-git-clone-including-submodules How to `git clone` including submodules?]\n\n\n[[Category:开源软件]]',	'utf-8'),
