(333,	'== Actor ==\n[http://actor.im/ Actor] 是由 Telegram 部分开发人员创建。\n\n== Actor Server ==\n\n=== Mac 编译 ===\n* 安装 Java 8: http://download.oracle.com/otn-pub/java/jdk/8u51-b16/jdk-8u51-macosx-x64.dmg\n* brew install protobuf-c\n* cd actor-server && ./sbt dist\n\n== Ubuntu 部署 ==\n* 安装、配置 PostgreSQL，创建一个 md5 验证的用户: \n<code>createuser actor</code>\n* 参考 config 目录下的模版，创建 <code>config/application.conf</code> 配置文件\n\n=== 错误处理 ===\n* org.postgresql.util.PSQLException: ERROR: could not open extension control file \"/usr/share/postgresql/9.3/extension/ltree.control\": No such file or directory\n\n<code>apt-get install postgresql-contrib</code>\n\nThen run SQL command:\n<code> CREATE EXTENSION ltree;</code>\n\n[[Category:开源软件]]',	'utf-8'),
(334,	'\'\'\'Hi 你可以在这里整理、分享知识，添加你认为有用的内容 ：）\'\'\'\n\n== 原则 ==\n说几个词条编辑原则：\n\n* 词条的 title 为树形结构，有子分类的 title ，需要加前缀 “ Category:”，比如 [[:Category:计算机/编程语言]]\n* 非原创的内容，尽量放链接，但是需要添加链接内容描述。词条内容不仅仅包括定义，可以涵盖不同属性，参考 [[:Category:软件开发/iOS]] 。\n* 跟自己的工作或者生活相关，能对他人有帮助的信息，信息越直观越好，有图片、视频的优先展示\n* 地域性差异比较大的内容，建议在城市大类里面分散编辑，比如吃喝玩乐\n* 公共分类，尽量保持客观中立。如果想表达个人观点，把 title 格式设置为 User:$yourname/$title，例如 [[User:Root/北京房价]]\n\n== 技术 ==\n\n* [[:Category:计算机]]\n* [[:Category:软件开发]]\n* [[:Category:开源软件]]\n* [[:Category:操作系统]]\n\n== 生活 ==\n* [[:Category:北京市]]\n* [[:Category:杭州市]]\n* [[:Category:玩具]]\n* [[:Category:电子游戏]]\n* [[:Category:400电话/诈骗]]\n* [[:Category:个人隐私保护]]\n\n== 参考信息 ==\n* [[中国人口统计]]\n\n== 艺术 ==\n* [[音乐制作软件]]\n\n== 入门 ==\n* [//zh.wikipedia.org/wiki/Help:编辑页面 MediaWiki编辑语法]\n\n== RoomChat ==\n* RoomChat产品、功能设计：[[RoomChat]]\n* 编辑工具 HTML to Markdown：https://liruqi.github.io/html2markdown/',	'utf-8'),
