(341,	'==数据备份==\n* 计划每天把数据库 dump 成文本格式提交到 github，这样可以方便用户用户关注内容变更。\n* 可以通过 github 提交 PR 来更新 wiki。\n\n==编辑工具==\n* HTML to Wiki: http://wiki-conv.appspot.com/\n* HTML to Markdown: https://liruqi.github.io/html2markdown\n\n==Social==\n* 每个词条展示创建者，贡献者\n* 用户可以关注此条，首页 timeline 显示被关注词条的变更\n* 大的词条类别，可以展示即时讨论的界面\n\n==编辑==\n* 词条修改不能即时生效，至少需要一位贡献者 approve 才可以。\n* 制作浏览器插件，可以把网页收藏、提交到某个分类。根据评分系统判断其链接在词条中展示的位置。\n* 权限管理：初级用户只能发链接，以及连接的描述；分类管理成员可以修改分类、title 的描述。\n\n==移动客户端==\n移动客户端分几个 Tab，\n* 生活\n* 工作\n* 读书\n* 历史\n* 电影\n* 音乐\n\n每个tab下做子分类。\n\n[[RoomChat/更新日志]]',	'utf-8'),
(342,	'\'\'\'Hi 你可以在这里整理、分享知识，添加你认为有用的内容 ：）\'\'\'\n\n== 原则 ==\n说几个词条编辑原则：\n\n* 词条的 title 为树形结构，有子分类的 title ，需要加前缀 “ Category:”，比如 [[:Category:计算机/编程语言]]\n* 非原创的内容，尽量放链接，但是需要添加链接内容描述。词条内容不仅仅包括定义，可以涵盖不同属性，参考 [[:Category:软件开发/iOS]] 。\n* 跟自己的工作或者生活相关，能对他人有帮助的信息，信息越直观越好，有图片、视频的优先展示\n* 地域性差异比较大的内容，建议在城市大类里面分散编辑，比如吃喝玩乐\n* 公共分类，尽量保持客观中立。如果想表达个人观点，把 title 格式设置为 User:$yourname/$title，例如 [[User:Root/北京房价]]\n\n== 技术 ==\n\n* [[:Category:计算机]]\n* [[:Category:软件开发]]\n* [[:Category:开源软件]]\n* [[:Category:操作系统]]\n\n== 生活 ==\n* [[:Category:北京市]]\n* [[:Category:杭州市]]\n* [[:Category:玩具]]\n* [[:Category:电子游戏]]\n* [[:Category:400电话/诈骗]]\n* [[:Category:个人隐私保护]]\n\n== 参考信息 ==\n* [[中国人口统计]]\n\n== 艺术 ==\n* [[音乐制作软件]]\n\n== 入门 ==\n* [//zh.wikipedia.org/wiki/Help:编辑页面 MediaWiki编辑语法]\n\n== RoomChat ==\n* RoomChat产品、功能设计：[[RoomChat]]',	'utf-8'),
