(364,	'== 使用 ==\n* Provisioning profile 路径：<code>~/Library/MobileDevice/Provisioning\\ Profiles</code> [http://stackoverflow.com/questions/18923095/ stackoverflow://q/18923095]\n\n== 功能 ==\n\n* [http://nshipster.com/xcode-snippets/ Xcode Snippets]\n\n== 调试 ==\n\n* [http://stackoverflow.com/questions/763774/ Formatting integer for string output]\n\n== App Store 提交报错 ==\n\n* [http://stackoverflow.com/questions/26790554/ iOS app submission : missing 64-bit support]\n\n== 第三方工具 ==\n\nXcode 插件管理：https://github.com/supermarin/Alcatraz 。这里推荐几个：\n* [https://github.com/markohlebar/Peckham github://markohlebar/Peckham]：simplifies adding #import-s.\n\n[[Category:软件开发/iOS]]',	'utf-8'),
(365,	'[[https://cocoapods.org/ CocoaPods] is the dependency manager for Swift and Objective-C Cocoa projects. \n\n== 使用 ==\n* <code>pod install</code> 安装卡死 [http://stackoverflow.com/questions/23755974 \'pod install\' takes forever]: \n\n  pod repo remove master\n  pod setup\n  pod install\n\n或者 \n\n  sudo gem update\n\n* 使用 Spec 镜像：http://icyleaf.com/2015/01/speed-up-cocoapods/\n\n[[Category:软件开发/iOS]]',	'utf-8'),
