(370,	'[https://git-scm.com/ Git]\n\n== 使用 ==\n=== merge ===\n* 同步上游 Repo 的变更: [https://help.github.com/articles/merging-an-upstream-repository-into-your-fork/ Merging an upstream repository into your fork]\n\n=== submodule ===\n\n* Add submodule to path: <code>git submodule add https://github.com/facebook/pop Telegraph/thirdparty/pop</code>\n* `git clone` including submodules: <code>git clone --recursive https://github.com/liruqi/Telegram-iOS</code> \n* Checkout all submodules for existing repo: <code> git submodule update --init --recursive </code> \n* 彻底删除一个 submodule ：<code>git submodule deinit && rm -rfv .git/modules/*</code>\n* 更新 submodule 版本到 HEAD：<code>git submodule foreach git pull origin master</code>，如果 HEAD 版本测试没有问题，再 git 提交 submodule 变更，即可生效。\n\n=== branch ===\n* Manage branches on GitHub: [https://github.com/blog/1377-create-and-delete-branches Create and delete branches]\n\n=== fetch ===\n* 获取完整提交纪录：`git fetch --unshallow old` http://stackoverflow.com/questions/28983842\n参考 \n* [http://stackoverflow.com/questions/3796927/how-to-git-clone-including-submodules How to `git clone` including submodules?]\n\n\n[[Category:开源软件]]',	'utf-8'),
(371,	'这个分类主要介绍 iOS 卡法中 App Store 提交的问题\n\n== 工具 ==\n* 生成带文字的应用截图：https://launchkit.io/screenshots/\n* 生成应用截图：https://appscreens.io/\n* 生成应用图标（iOS+Android）：http://makeappicon.com/\n* [[:Category:网络账号/XOJO.COM]]\n\n== 错误处理 ==\n* “Your binary is not optimized for iPhone 5” (ITMS-90096): [http://stackoverflow.com/questions/28830013 stackoverflow://questions/28830013]\n\n[[Category:软件开发/iOS]]',	'utf-8'),
(372,	'== 学习资源 ==\n* [http://developer.android.com/develop/index.html Develop Apps | Android Developers]\n\n== 项目重构 ==\n[[:Category:软件开发/Android/删除项目中无用的资源|删除项目中无用的资源]]\n\n== Q&A ==\n* [[:Category:软件开发/Android/更改应用默认语言|更改应用默认语言]]\n* [http://www.nextcomputers.org/NeXTfiles/Software/WebObjects/Guides/PortingObjectiveCtoJava.pdf Porting Objective-C to Java]\n* [http://www.wikihow.com/Edit-the-Contents-of-a-.Jar-File-on-a-Mac How to Edit the Contents of a .Jar File on a Mac]\n\n== IDE ==\n* Eclipse\n* Android Studio\n\n从 Eclipse 切换到 Android Studio，最不方便的地方在于快捷键。可以在 Android Studio 设置类似 Eclipse 的快捷键（Preference => Keymap）。\n* 显示类成员和方法：File Structure\n* 搜索 Java Class：Main menu | Navigate | Class...\n\n== 第三方工具 ==\n* 崩溃统计 [[:Category:软件开发/Android/Fabric|Fabric/Crashlytics]]\n\n== 反编译 ==\n反编译工具：\n* decompiling DEX into Java sourcecode [http://stackoverflow.com/questions/1249973/ stackoverflow://questions/1249973]\n* [https://github.com/iBotPeaches/Apktool github://iBotPeaches/Apktool]\n\n参考[http://www.douban.com/note/253945798/ Android application reverse engineering & rebuilding]。\n\n== 第三方SDK ==\n=== VK ===\n* VK SDK 有可能授权之后无反应，可以尝试把 <code>VKSdk.authorize(scope, true, false);</code> 改为 <code>VKSdk.authorize(scope, false, true);</code> 参考 https://github.com/VKCOM/vk-android-sdk/issues/80\n\n[[Category:软件开发]]',	'utf-8'),
(373,	'\"In iOS 8 and later, you can create a XIB or storyboard file instead of a static launch image.\" 虽然文档上这么写，但是iOS9 发布之后，App Store 审核会要求 info.plist 有静态的 launch image。\n\n* https://developer.apple.com/library/ios/documentation/UserExperience/Conceptual/MobileHIG/LaunchImages.html\n* http://stackoverflow.com/questions/28830013/your-binary-is-not-optimized-for-iphone-5-itms-90096-when-submitting/32774398#32774398',	'utf-8'),
(374,	'\"In iOS 8 and later, you can create a XIB or storyboard file instead of a static launch image.\" 虽然文档上这么写，但是iOS9 发布之后，App Store 审核会要求 info.plist 有静态的 launch image。\n\n* https://developer.apple.com/library/ios/documentation/UserExperience/Conceptual/MobileHIG/LaunchImages.html\n* http://stackoverflow.com/questions/28830013/your-binary-is-not-optimized-for-iphone-5-itms-90096-when-submitting/32774398#32774398\n\n[[Category:软件开发/iOS]]',	'utf-8'),
(375,	'== iOS Dev Center ==\nhttps://developer.apple.com/devcenter/ios/index.action\n\n== 教程 ==\n* http://objc.io/\n* http://www.raywenderlich.com/\n\n== 证书 ==\n* 创建 APNS 推送证书 [http://www.raywenderlich.com/32960/apple-push-notification-services-in-ios-6-tutorial-part-1 Apple Push Notification Services in iOS 6 Tutorial: Part 1/2]\n\n== SDK ==\n\n=== iOS7 ===\niOS 对状态栏 (Status Bar)、导航栏(Navigation Bar) 做了很大的改造，设计美感提升很多，给开发者带来的问题也很多。\n\n* iOS7 下修改状态栏颜色 [http://stackoverflow.com/questions/17678881/how-to-change-status-bar-text-color-in-ios-7 How to change Status Bar text color in iOS 7]\n* <code>- preferredStatusBarStyle</code> 无法修改状态栏颜色，其中存在 UINavigationController 的时候需要单独处理 [http://stackoverflow.com/questions/19022210/preferredstatusbarstyle-isnt-called preferredStatusBarStyle isn\'t called]\n* 导航栏颜色失真、泛白，设置 Navigation Bar 的 translucent 属性为 NO。translucent 属性带来的色值转换：[http://stackoverflow.com/questions/18895252/get-the-right-color-in-ios7-translucent-navigation-bar Get the right color in iOS7 translucent navigation bar]\n\n=== UITabBarController ===\n<code>UITabBarController</code> 自带了 <code>UITabBar</code> 视图。使用的时候，不应该直接管理 <code>UITabBar</code> 的 items。而应该用 <code>UITabBarController</code> 提供的  <code>-  (void)setViewControllers</code> 系列方法。\n\n=== AVFoundation ===\n* [http://www.appcoda.com/ios-avfoundation-framework-tutorial iOS Programming 101: Record and Play Audio using AVFoundation Framework]\n* [https://www.objc.io/issues/24-audio/audio-api-overview/ Audio API Overview]\n\n== 崩溃统计 ==\n常用的有下面几个：\n* Crashlytics\n* Crittercism\n* Bugsense\n* HockeyApp\n\n具体分析和使用参考 Overview of iOS Crash Reporting Tools: [http://www.raywenderlich.com/33669/overview-of-ios-crash-reporting-tools-part-1 Part 1/2], [http://www.raywenderlich.com/34050/overview-of-ios-crash-reporting-tools-part-2 Part 2/2] (2013年5月，其中介绍了TestFlight，但被苹果收购之后，TestFlight 崩溃统计功能被阉割)\n\n== iOS开发博客 ==\n* [http://www.devtang.com/ 唐巧的技术博客]\n* [http://blog.sunnyxx.com/ sunnyxx的技术博客]\n* [https://github.com/tangqiaoboy/iOSBlogCN/blob/master/README.md 中文 iOS/Mac 开发博客列表]\n\n[[Category:软件开发]]',	'utf-8'),
(376,	'== 下载 ==\nBitTorrent 或者 e2dk、磁力链接资源可以使用百度网盘离线下载。\n\n* http://dianying.fm/\n* https://kat.cr/',	'utf-8'),
