(386,	'\n== iOS9适配 ==\n\n* 容许 HTTP：在 info.plist 文件中添加：\n\n  <key>NSAppTransportSecurity</key>\n  <dict>\n    <!--Connect to anything (this is probably BAD)-->\n    <key>NSAllowsArbitraryLoads</key>\n    <true/>\n  </dict>\n\n* [https://www.hackingwithswift.com/safari-content-blocking-ios9 Safari Content Blocking in iOS 9: a tutorial by example]\n\n[[Category:软件开发/iOS]]',	'utf-8'),
(387,	'== 使用 ==\n* Provisioning profile 路径：<code>~/Library/MobileDevice/Provisioning\\ Profiles</code> [http://stackoverflow.com/questions/18923095/ stackoverflow://q/18923095]\n\n== 功能 ==\n\n* [http://nshipster.com/xcode-snippets/ Xcode Snippets]\n* 每次编译后自动让 Build / CFBundleVersion 加一：在 Run Script 中添加代码\n<code>\n#!/bin/sh\n\nplist=\"${PROJECT_DIR}/${INFOPLIST_FILE}\"\ndir=\"$(dirname \"$plist\")\"\n\nbuildnum=$(/usr/libexec/Plistbuddy -c \"Print CFBundleVersion\" \"$plist\")\nif [ -z \"$buildnum\" ]; then\n    echo \"No build number in $plist\"\n    exit 2\nfi\n\nbuildnum=$(expr $buildnum + 1)\n/usr/libexec/Plistbuddy -c \"Set CFBundleVersion $buildnum\" \"$plist\"\n</code> \n参考 Telegram iOS 代码：https://github.com/liruqi/Telegram-iOS/\n\n== 调试 ==\n\n* [http://stackoverflow.com/questions/763774/ Formatting integer for string output]\n\n== App Store 提交报错 ==\n\n* [http://stackoverflow.com/questions/26790554/ iOS app submission : missing 64-bit support]\n\n== 第三方工具 ==\n\nXcode 插件管理：https://github.com/supermarin/Alcatraz 。这里推荐几个：\n* [https://github.com/markohlebar/Peckham github://markohlebar/Peckham]：simplifies adding #import-s.\n\n[[Category:软件开发/iOS]]',	'utf-8'),
(388,	'== 使用 ==\n* Provisioning profile 路径：<code>~/Library/MobileDevice/Provisioning\\ Profiles</code> [http://stackoverflow.com/questions/18923095/ stackoverflow://q/18923095]\n\n== 功能 ==\n\n* [http://nshipster.com/xcode-snippets/ Xcode Snippets]\n* 每次编译后自动让 Build / CFBundleVersion 加一：在 Run Script 中添加代码\n  plist=\"${PROJECT_DIR}/${INFOPLIST_FILE}\"\n  dir=\"$(dirname \"$plist\")\"\n  buildnum=$(/usr/libexec/Plistbuddy -c \"Print CFBundleVersion\" \"$plist\")\n  if [ -z \"$buildnum\" ]; then\n    echo \"No build number in $plist\"\n    exit 2\n  fi\n  buildnum=$(expr $buildnum + 1)\n  /usr/libexec/Plistbuddy -c \"Set CFBundleVersion $buildnum\" \"$plist\"\n\n参考 Telegram iOS 代码：https://github.com/liruqi/Telegram-iOS/\n\n== 调试 ==\n\n* [http://stackoverflow.com/questions/763774/ Formatting integer for string output]\n\n== App Store 提交报错 ==\n\n* [http://stackoverflow.com/questions/26790554/ iOS app submission : missing 64-bit support]\n\n== 第三方工具 ==\n\nXcode 插件管理：https://github.com/supermarin/Alcatraz 。这里推荐几个：\n* [https://github.com/markohlebar/Peckham github://markohlebar/Peckham]：simplifies adding #import-s.\n\n[[Category:软件开发/iOS]]',	'utf-8'),
(390,	'这个分类主要介绍 iOS 卡法中 App Store 提交的问题\n\n== 工具 ==\n\n在线生成工具：\n\n* 生成带文字的应用截图：https://launchkit.io/screenshots/\n* 生成应用截图：https://appscreens.io/\n* 生成应用图标（iOS+Android）：http://makeappicon.com/\n* [[:Category:网络账号/XOJO.COM]]\n\n本地脚本：\n* https://github.com/liruqi/iOS-resource-generator\n\n== 错误处理 ==\n* “Your binary is not optimized for iPhone 5” (ITMS-90096): [http://stackoverflow.com/questions/28830013 stackoverflow://questions/28830013]\n\n[[Category:软件开发/iOS]]',	'utf-8'),
(402,	'\n== iOS9适配 ==\n\n* iOS 9 默认安全策略禁止 HTTP 请求。容许 HTTP：在 info.plist 文件中添加：\n\n  <key>NSAppTransportSecurity</key>\n  <dict>\n    <!--Connect to anything (this is probably BAD)-->\n    <key>NSAllowsArbitraryLoads</key>\n    <true/>\n  </dict>\n\n* [https://www.hackingwithswift.com/safari-content-blocking-ios9 Safari Content Blocking in iOS 9: a tutorial by example]\n\n* iOS 9 需要在 Info.plist 里定义需要用到的 scheme，否则 <code>- canOpenURL</code> 方法会直接返回false。http://stackoverflow.com/questions/30987986/\n\n[[Category:软件开发/iOS]]',	'utf-8'),
(403,	'\n== iOS9适配 ==\n\n* iOS 9 默认安全策略禁止 HTTP 请求。容许 HTTP：在 info.plist 文件中添加：\n\n  <key>NSAppTransportSecurity</key>\n  <dict>\n    <!--Connect to anything (this is probably BAD)-->\n    <key>NSAllowsArbitraryLoads</key>\n    <true/>\n  </dict>\n\n* [https://www.hackingwithswift.com/safari-content-blocking-ios9 Safari Content Blocking in iOS 9: a tutorial by example]\n\n* iOS 9 需要在 Info.plist 里定义需要用到的 scheme，否则 <code>- canOpenURL</code> 方法会直接返回<code>NO</code>。http://stackoverflow.com/questions/30987986/\n\n[[Category:软件开发/iOS]]',	'utf-8'),
(404,	'\n== iOS9适配 ==\n\n* iOS 9 默认安全策略禁止 HTTP 请求。容许 HTTP：在 info.plist 文件中添加：\n\n  <key>NSAppTransportSecurity</key>\n  <dict>\n    <!--Connect to anything (this is probably BAD)-->\n    <key>NSAllowsArbitraryLoads</key>\n    <true/>\n  </dict>\n\n* [https://www.hackingwithswift.com/safari-content-blocking-ios9 Safari Content Blocking in iOS 9: a tutorial by example]\n\n* iOS 9 需要在 Info.plist 里定义需要用到的 scheme，否则 <code>- canOpenURL</code> 方法会直接返回<code>NO</code>。参考：http://awkwardhare.com/post/121196006730/quick-take-on-ios-9-url-scheme-changes http://stackoverflow.com/questions/30987986/\n\n[[Category:软件开发/iOS]]',	'utf-8'),
(405,	'\n== iOS9适配 ==\n\n* iOS 9 默认安全策略禁止 HTTP 请求。容许 HTTP：在 info.plist 文件中添加：\n\n  <key>NSAppTransportSecurity</key>\n  <dict>\n    <!--Connect to anything (this is probably BAD)-->\n    <key>NSAllowsArbitraryLoads</key>\n    <true/>\n  </dict>\n\n* [https://www.hackingwithswift.com/safari-content-blocking-ios9 Safari Content Blocking in iOS 9: a tutorial by example]\n\n* iOS 9 需要在 Info.plist 里定义需要用到的 scheme，否则 <code>- canOpenURL</code> 方法会直接返回<code>NO</code>，但是在当前的 iOS 9.0.2 版本中，并不影响<code>- openURL</code> 方法的行为。\n参考：http://awkwardhare.com/post/121196006730/quick-take-on-ios-9-url-scheme-changes http://stackoverflow.com/questions/30987986/\n\n[[Category:软件开发/iOS]]',	'utf-8'),
(406,	'\n== iOS9适配 ==\n\n* iOS 9 默认安全策略禁止 HTTP 请求。容许 HTTP：在 info.plist 文件中添加：\n\n  <key>NSAppTransportSecurity</key>\n  <dict>\n    <!--Connect to anything (this is probably BAD)-->\n    <key>NSAllowsArbitraryLoads</key>\n    <true/>\n  </dict>\n\n* [https://www.hackingwithswift.com/safari-content-blocking-ios9 Safari Content Blocking in iOS 9: a tutorial by example]\n\n* iOS 9 需要在 Info.plist 里定义需要用到的 scheme，比如：\n  <key>LSApplicationQueriesSchemes</key>\n    <array>\n     <string>fbapi</string>\n     <string>fbauth2</string>\n     <string>fbshareextension</string>\n     <string>fb-messenger-api</string>\n     <string>twitter</string>\n     <string>whatsapp</string>\n     <string>wechat</string>\n     <string>line</string>\n     <string>instagram</string>\n     <string>kakaotalk</string>\n     <string>mqq</string>\n     <string>vk</string>\n     <string>comgooglemaps</string>\n    </array>\n如果未设置 <code>LSApplicationQueriesSchemes</code>，<code>- canOpenURL</code> 方法会直接返回<code>NO</code>。在 iOS 9 beta pre-release 中，<code>- openURL</code> 也方法不会有响应，只会在 syslog 报错：“This app is not allowed to query for scheme xxx”；但是在当前的 iOS 9.0.2 版本中，<code>- openURL</code> 方法调用不会受影响。\n\n参考：http://awkwardhare.com/post/121196006730/quick-take-on-ios-9-url-scheme-changes http://stackoverflow.com/questions/30987986/\n\n== What\'s New in iOS ==\n* [https://developer.apple.com/library/prerelease/ios/releasenotes/General/WhatsNewIniOS/Articles/iOS9.html iOS 9.0]\n* [https://developer.apple.com/library/prerelease/ios/releasenotes/General/WhatsNewIniOS/Articles/iOS9_1.html iOS 9.0]\n\n[[Category:软件开发/iOS]]',	'utf-8'),
(407,	'\n== iOS9适配 ==\n\n* iOS 9 默认安全策略禁止 HTTP 请求。容许 HTTP：在 info.plist 文件中添加：\n\n  <key>NSAppTransportSecurity</key>\n  <dict>\n    <!--Connect to anything (this is probably BAD)-->\n    <key>NSAllowsArbitraryLoads</key>\n    <true/>\n  </dict>\n\n* [https://www.hackingwithswift.com/safari-content-blocking-ios9 Safari Content Blocking in iOS 9: a tutorial by example]\n\n* iOS 9 需要在 Info.plist 里定义需要用到的 scheme，比如：\n  <key>LSApplicationQueriesSchemes</key>\n    <array>\n     <string>fbapi</string>\n     <string>fbauth2</string>\n     <string>fbshareextension</string>\n     <string>fb-messenger-api</string>\n     <string>twitter</string>\n     <string>whatsapp</string>\n     <string>wechat</string>\n     <string>line</string>\n     <string>instagram</string>\n     <string>kakaotalk</string>\n     <string>mqq</string>\n     <string>vk</string>\n     <string>comgooglemaps</string>\n    </array>\n如果未设置 <code>LSApplicationQueriesSchemes</code>，<code>- canOpenURL</code> 方法会直接返回<code>NO</code>。在 iOS 9 beta pre-release 中，<code>- openURL</code> 也方法不会有响应，只会在 syslog 报错：“This app is not allowed to query for scheme xxx”；但是在当前的 iOS 9.0.2 版本中，<code>- openURL</code> 方法调用不会受 plist 影响。\n\n参考：http://awkwardhare.com/post/121196006730/quick-take-on-ios-9-url-scheme-changes http://stackoverflow.com/questions/30987986/\n\n== What\'s New in iOS ==\n* [https://developer.apple.com/library/prerelease/ios/releasenotes/General/WhatsNewIniOS/Articles/iOS9.html iOS 9.0]\n* [https://developer.apple.com/library/prerelease/ios/releasenotes/General/WhatsNewIniOS/Articles/iOS9_1.html iOS 9.0]\n\n[[Category:软件开发/iOS]]',	'utf-8'),
