(411,	'\n== iOS9适配 ==\n\n* iOS 9 默认安全策略禁止 HTTP 请求。容许 HTTP：在 info.plist 文件中添加：\n\n  <key>NSAppTransportSecurity</key>\n  <dict>\n    <!--Connect to anything (this is probably BAD)-->\n    <key>NSAllowsArbitraryLoads</key>\n    <true/>\n  </dict>\n\n* [https://www.hackingwithswift.com/safari-content-blocking-ios9 Safari Content Blocking in iOS 9: a tutorial by example]\n\n=== URL Scheme ===\n\n* iOS 9 需要在 Info.plist 里定义需要用到的 scheme，比如：\n  <key>LSApplicationQueriesSchemes</key>\n    <array>\n     <string>fbapi</string>\n     <string>fbauth2</string>\n     <string>fbshareextension</string>\n     <string>fb-messenger-api</string>\n     <string>twitter</string>\n     <string>whatsapp</string>\n     <string>wechat</string>\n     <string>line</string>\n     <string>instagram</string>\n     <string>kakaotalk</string>\n     <string>mqq</string>\n     <string>vk</string>\n     <string>comgooglemaps</string>\n    </array>\n如果未设置 <code>LSApplicationQueriesSchemes</code>：\n* <code>- canOpenURL</code> 方法会直接返回<code>NO</code>\n* 在 iOS 9 beta pre-release 中，<code>- openURL</code> 也方法不会有响应，只会在 syslog 报错：“This app is not allowed to query for scheme xxx”；但是在当前的 iOS 9.0.2 版本中，<code>- openURL</code> 方法调用不会受 plist 影响。\n\n参考：\n* http://awkwardhare.com/post/121196006730/quick-take-on-ios-9-url-scheme-changes\n* http://stackoverflow.com/questions/30987986/\n\n== What\'s New in iOS ==\n* [https://developer.apple.com/library/prerelease/ios/releasenotes/General/WhatsNewIniOS/Articles/iOS9.html iOS 9.0]\n* [https://developer.apple.com/library/prerelease/ios/releasenotes/General/WhatsNewIniOS/Articles/iOS9_1.html iOS 9.1]\n\n[[Category:软件开发/iOS]]',	'utf-8'),
(650,	'个人隐私保护有几个需要注意的地方。\n\n* 不需要注册即可使用的网站，就不要注册\n* 给不同的网站设置不同的密码，防止某个网站数据泄漏之后拿来撞库；如果记不住，可以在可靠的地方集中存储一份密码列表，比如使用 [https://agilebits.com/onepassword 1Password]、LastPass 等工具；另外 Mac 的 keychain 可以多设备同步，Chrome 浏览器也有同步记住密码功能。\n* 不信任的网站使用临时邮箱注册，比如 [https://www.guerrillamail.com/ Guerrilla Mail]\n* 不信任的网站使用临时的账号登录，本站有一个公共账号列表：[[:Category:网络账号]]\n* 需要手机号注册的网站使用临时手机号注册，比如国外的 [http://receivefreesms.com/ receivefreesms.com] 以及国内的阿里小号。',	'utf-8'),
(651,	'个人隐私保护有几个需要注意的地方。\n\n* 不需要注册即可使用的网站，就不要注册\n* 给不同的网站设置不同的密码，比如用网站域名作为密码，防止某个网站数据泄漏之后拿来撞库。\n* 在可靠的地方集中存储一份密码列表，比如使用 [https://agilebits.com/onepassword 1Password]、LastPass 等工具；另外 Mac 的 keychain 可以多设备同步，Chrome 浏览器也有同步记住密码功能。\n* 不信任的网站使用临时邮箱注册，比如 [https://www.guerrillamail.com/ Guerrilla Mail]\n* 不信任的网站使用临时的账号登录，本站有一个公共账号列表：[[:Category:网络账号]]\n* 需要手机号注册的网站使用临时手机号注册，比如国外的 [http://receivefreesms.com/ receivefreesms.com] 以及国内的阿里小号。',	'utf-8'),
(660,	'可以在这里找到一些公开的网络账号。可用于个人的隐私保护。原由：http://liruqi.info/post/59185719696/publish-my-skype-account\n\n各位有不用的账号，欢迎删除其中个人信息，共享出来。其中，http://justdelete.me/ 里不可删除的账号建议优先共享。\n\n账号分享类站点：\n* http://www.vipfenxiang.com/\n\n[[Category:个人隐私保护]]',	'utf-8'),
(661,	'\n== iOS9适配 ==\n\n* iOS 9 默认安全策略禁止 HTTP 请求。容许 HTTP：在 info.plist 文件中添加：\n\n  <key>NSAppTransportSecurity</key>\n  <dict>\n    <!--Connect to anything (this is probably BAD)-->\n    <key>NSAllowsArbitraryLoads</key>\n    <true/>\n  </dict>\n\n* [https://www.hackingwithswift.com/safari-content-blocking-ios9 Safari Content Blocking in iOS 9: a tutorial by example]\n\n=== URL Scheme ===\n\n* iOS 9 需要在 Info.plist 里定义需要用到的 scheme，比如：\n  <key>LSApplicationQueriesSchemes</key>\n    <array>\n     <string>fbapi</string>\n     <string>fbauth2</string>\n     <string>fbshareextension</string>\n     <string>fb-messenger-api</string>\n     <string>twitter</string>\n     <string>whatsapp</string>\n     <string>wechat</string>\n     <string>line</string>\n     <string>instagram</string>\n     <string>kakaotalk</string>\n     <string>mqq</string>\n     <string>vk</string>\n     <string>comgooglemaps</string>\n    </array>\n如果未设置 <code>LSApplicationQueriesSchemes</code>：\n* <code>- canOpenURL</code> 方法会直接返回<code>NO</code>\n* 在 iOS 9 beta pre-release 中，<code>- openURL</code> 也方法不会有响应，只会在 syslog 报错：“This app is not allowed to query for scheme xxx”；但是在当前的 iOS 9.0.2 版本中，<code>- openURL</code> 方法调用不会受 plist 影响。\n\n参考：\n* http://awkwardhare.com/post/121196006730/quick-take-on-ios-9-url-scheme-changes\n* http://stackoverflow.com/questions/30987986/\n\n== What\'s New in iOS ==\n* [https://developer.apple.com/library/prerelease/ios/releasenotes/General/WhatsNewIniOS/Articles/iOS9.html iOS 9.0]\n* [https://developer.apple.com/library/prerelease/ios/releasenotes/General/WhatsNewIniOS/Articles/iOS9_1.html iOS 9.1]\n\n== 使用 ==\n* [http://www.pgyer.com/doc/view/inhouse_app_ios9 在 iOS 9 中运行企业版应用]\n\n[[Category:软件开发/iOS]]',	'utf-8'),
