(934,	'大家好，我是李如其。RoomChat 站长。因为这是我的网站，root 这个用户名又比较牛逼，我就叫 root 好了。\n\n首字母自动大写很讨厌，我有时间再把这规矩给改了。\n\n* 邮箱：admin@roomchat.im\n* 更多关于我：https://about.me/liruqi\n\n== 文章 ==\n* [[User:Root/北京房价]]\n* [[User:Root/Telegram]]\n* [[User:Root/Actor]]',	'utf-8'),
(935,	'\n* Github: https://github.com/actorapp/actor-platform/\n* iOS 客户端模型层代码路径：actor-sdk/sdk-core/core/core-shared/src/main/java/im/actor/core\n\n= 客户端架构 =\n* 使用 j2objc 同步 iOS / Android 模型层代码\n* 使用 mvvm 架构做功能交互，https://www.objc.io/issues/13-architecture/mvvm/\n\n[[Category:开源软件/Actor]]',	'utf-8'),
(949,	'\n* Github: https://github.com/actorapp/actor-platform/\n\n\n== iOS ==\n\n* iOS 客户端模型层代码路径：actor-sdk/sdk-core/core/core-shared/src/main/java/im/actor/core\n\n=== 架构 ===\n* 使用 j2objc 同步 iOS / Android 模型层代码\n* 使用 mvvm 架构做功能交互，https://www.objc.io/issues/13-architecture/mvvm/\n\n=== 编译步骤 ===\n* `bash buildFramework.sh `\n* Xcode 打开 ActorSDK.xcworkspace 文件\n\n[[Category:开源软件/Actor]]',	'utf-8'),
